sdfha sfsahdfkhsfjkhsakjdfh. dfhksfhkasf kashf fhasjkhfjkasdfha sfsahdfkhsfjkhsakjdfh. dfhksfhkasf kashf fhasjkhfjkasdfha sfsahdfkhsfjkhsakjdfh. dfhksfhkasf kashf fhasjkhfjkasdfha sfsahdfkhsfjkhsakjdfh. dfhksfhkasf kashf\", \"type\": \"text\"}','2022-11-07 11:47:33',9993000002,'6VFT_15OEe2vc0YouK5zcQ','2022-11-07 11:47:33'),(5951,43,10041,'{\"text\": \"fhjsahdf\", \"type\": \"text\", \"reference\": 5950}','2022-11-07 11:47:37',9993000003,'65U9p15OEe2vc0YouK5zcQ','2022-11-07 11:47:37'),(5952,43,10037,'{\"text\": \"大洒\", \"type\": \"text\"}','2022-11-07 15:09:34',6481000001,'IabQU15rEe2vc0YouK5zcQ','2022-11-07 15:09:33'),(5953,43,10037,'{\"text\": \"asdsa\", \"type\": \"text\"}','2022-11-07 15:11:08',9616000001,'WgM1M15rEe2vc0YouK5zcQ','2022-11-07 15:11:08'),(5954,43,10037,'{\"text\": \"<br>我第一次被强奸了我今年35岁，之前有段不好的感情留下了阴影一直没有找对象。单身五六年，上班的时候和正常人一样，下班靠游戏打发时间，不泡吧不乱搞不暧昧，朋友圈干净，生活乏味。   强奸我的人是我游戏里战队的队长，加了微信好几年没怎么聊天，战队里成天喊哥哥撒娇的姑娘多的是，而我就是一个沉默的菜鸡。但是奇怪的是那么多妹子里他总经常喊我打游戏，应该是看我们是同一个地方的吧，他也喊了我好几次出来吃饭，我总是各种理由推辞，总是说下次，或者上了什么什么段位着。推脱了一两年了后来实在没有理由推脱不过去了，又约吃饭我就去了，虽然我35岁了，但是我长得很好看也不显年纪。他看见我一愣眼睛马上亮了起来。吃饭期间他就明确表示要和我处对象让我明天给他答复，还说不要让我上班了让我跟他干给我开双倍三倍工资养我之类的，我心里觉得这个人不着调，回去就删除微信，他比我小4岁，满嘴跑火车，期间他喝了一瓶汾酒，我没喝。期间又问我谈过几个对象，他说他就日过三个女人我是第四个，我当时还觉得这个人是个傻逼满嘴吹牛逼跑火车根本没意识到后面发生的事。吃完饭他非要去唱歌，我一直拒绝，他就撒娇说要给我唱首歌之类的，我被缠的不行说可以去但是你不能喝酒了，他答应了，到这还很正常没有过分行为。到了后我先去上了个厕所他又要了12瓶啤酒，我回来后他到了两杯，让我喝酒，见我不喝他说他没有下药，为了证明清白他把两杯都喝了，我坚持一滴都不喝，气氛有些尴尬，我说我给你点歌吧，唱了一两首后他开始动手动脚，我烦了，我开始找他车钥匙要走(我车放在饭店，开的他车，我车钥匙放他车上了）我当时还没意识到后来即将发生的事。 我拿上他钥匙要出去，他拦住我，说对我做了什么让我这样，我当时还是很强硬态度，我用手拍着他胸口说你刚刚没这样拍我吗，你没摸我吗，后来又说了什么我记不太清了，我只记得我态度十分强硬可能骂了他把他激怒了，他说我今天就办了你，一下子把我扑倒了，我当时就慌了，我说你这是强奸，你知道要判多少年吗，他说你去告我吧我去坐牢，完全一点都不怕我会去告他。开始把手伸进我裙子里，还要把手伸进我嘴里，我推不开他开始使劲咬他，我一直奋力反抗呼喊无果，期间我试图跑出包间多次都让他脱回来，我俩站在桌子的两端对峙，他说你怎么这样，没见过你这样的，奋力的摔了一瓶酒出去了。我见机跑出包间，他从后面追来，我一口气跑到ktv大堂，那里很多人，他追过来要把我带回去，我此刻头脑非常冷静，我马上转身和一个服务员小哥说你能把我送下去么，可是服务员小哥转身离开了，他看见没人管闲事底气上来了，开始拉我，我奋力挣开继续对着服务员说，你叫什么名字！给我看看你工牌，如果今晚我出了事，你们一个都跑不掉，你也得进派出所。可是他依然没管，转身走了，大堂那么多人都看见都听见了，没有一个人见义勇为。他依然拉我回包间并开始给我道歉，甚至当众给我下跪了。我坚持要走，去他车里拿东西，他跟着我我甩不掉他，但是我心里还存在一丝幻想，车停在商场周边有人有灯，他不能对我怎样，他说我有两个选择，如果我要打车走他立马办了我，如果我不走他不碰我，我拿出东西马上跑开，他一把搂着我把我硬拽强塞进后排车里，我逃了好几次次次被他拖回来，形形色色很多人没有一个人伸出援手，后面的事情我记不太清了，我精神之前受过刺激，到了某一个顶点程度我会奔溃，我无论怎么奔溃怎么发疯他都没放我走，只是他依然没有得逞，后来我态度也缓和了很多，我求他我说我不跑，我把车开到饭店他同意了。到饭店停车场已经十一点多了，那天下着雨，周边都打烊了，我依然没有跑出去没有侥幸，我一遍遍说着我这么大年纪了求你放过我吧，我求求你。 他说我明天去坐牢我也要上你，我就是馋你身子。我已经绝望了，我知道哭喊和求饶没有任何作用，我说那你能戴套么，他说他没有让我外卖一个，我说我不叫，他说他没病也不在乎我有没有病，我当时精神已经奔溃和绝望。他一把扯下我内裤，我知道我完了，女人被强迫的时候只有深深的恶心，我死命咬着嘴唇不让他亲进来，他强行进入了我，该死的我平时看个老人捡破烂都流泪的人我居然没有哭，我无法形容我当时得感受，绝望恶心还是什么。因为我一直不配合，还一直死命咬他，他身上舌头让我咬了全是青紫色牙印，最后怎么结束的我记不清了，我再一次逃下车，这次他只跟着我没阻拦，我上车后马上锁上门开车而逃，他从后面开车跟着我，我怕他知道我的住处一直绕路画圈，他给我打电话问ktv名字说他耳机掉那了，他才没在跟着我，我不知道怎么开回家的，一遍遍清洗自己身体，我很脏 我没有去报警，虽然我一直恐吓他。他最后没有射出来我不知道能不能留下他的证据。回来后我把他微信游戏全部删掉，他加了我好几次说他错了他喜欢我之类的。我只觉得恶心。这件事过去两天了，白天我还能算正常和同事交流。但是一直阴着脸气色不好，我不敢和任何人说。我是去见网友了，第一次见面被强奸了，我穿的到脚裸长裙，我以为大家都是普通的正常人。我不知道为什么我的生活已经这么苦了还要被命运怎么对待。\", \"type\": \"text\"}','2022-11-07 15:21:02',9616000002,'vClceF5sEe2vc0YouK5zcQ','2022-11-07 15:21:02'),(5955,43,10041,'{\"text\": \"asdf\", \"type\": \"text\", \"reference\": 5954}','2022-11-07 15:25:37',2311000001,'YCRjfF5tEe2vc0YouK5zcQ','2022-11-07 15:25:37'),(5956,43,10041,'{\"text\": \"我第一次被强奸了我今年35岁，之前有段不好的感情留下了阴影一直没有找对象。单身五六年，上班的时候和正常人一样，下班靠游戏打发时间，不泡吧不乱搞不暧昧，朋友圈干净，生活乏味。   强奸我的人是我游戏里战队的队长，加了微信好几年没怎么聊天，战队里成天喊哥哥撒娇的姑娘多的是，而我就是一个沉默的菜鸡。但是奇怪的是那么多妹子里他总经常喊我打游戏，应该是看我们是同一个地方的吧，他也喊了我好几次出来吃饭，我总是各种理由推辞，总是说下次，或者上了什么什么段位着。推脱了一两年了后来实在没有理由推脱不过去了，又约吃饭我就去了，虽然我35岁了，但是我长得很好看也不显年纪。他看见我一愣眼睛马上亮了起来。吃饭期间他就明确表示要和我处对象让我明天给他答复，还说不要让我上班了让我跟他干给我开双倍三倍工资养我之类的，我心里觉得这个人不着调，回去就删除微信，他比我小4岁，满嘴跑火车，期间他喝了一瓶汾酒，我没喝。期间又问我谈过几个对象，他说他就日过三个女人我是第四个，我当时还觉得这个人是个傻逼满嘴吹牛逼跑火车根本没意识到后面发生的事。吃完饭他非要去唱歌，我一直拒绝，他就撒娇说要给我唱首歌之类的，我被缠的不行说可以去但是你不能喝酒了，他答应了，到这还很正常没有过分行为。到了后我先去上了个厕所他又要了12瓶啤酒，我回来后他到了两杯，让我喝酒，见我不喝他说他没有下药，为了证明清白他把两杯都喝了，我坚持一滴都不喝，气氛有些尴尬，我说我给你点歌吧，唱了一两首后他开始动手动脚，我烦了，我开始找他车钥匙要走(我车放在饭店，开的他车，我车钥匙放他车上了）我当时还没意识到后来即将发生的事。 我拿上他钥匙要出去，他拦住我，说对我做了什么让我这样，我当时还是很强硬态度，我用手拍着他胸口说你刚刚没这样拍我吗，你没摸我吗，后来又说了什么我记不太清了，我只记得我态度十分强硬可能骂了他把他激怒了，他说我今天就办了你，一下子把我扑倒了，我当时就慌了，我说你这是强奸，你知道要判多少年吗，他说你去告我吧我去坐牢，完全一点都不怕我会去告他。开始把手伸进我裙子里，还要把手伸进我嘴里，我推不开他开始使劲咬他，我一直奋力反抗呼喊无果，期间我试图跑出包间多次都让他脱回来，我俩站在桌子的两端对峙，他说你怎么这样，没见过你这样的，奋力的摔了一瓶酒出去了。我见机跑出包间，他从后面追来，我一口气跑到ktv大堂，那里很多人，他追过来要把我带回去，我此刻头脑非常冷静，我马上转身和一个服务员小哥说你能把我送下去么，可是服务员小哥转身离开了，他看见没人管闲事底气上来了，开始拉我，我奋力挣开继续对着服务员说，你叫什么名字！给我看看你工牌，如果今晚我出了事，你们一个都跑不掉，你也得进派出所。可是他依然没管，转身走了，大堂那么多人都看见都听见了，没有一个人见义勇为。他依然拉我回包间并开始给我道歉，甚至当众给我下跪了。我坚持要走，去他车里拿东西，他跟着我我甩不掉他，但是我心里还存在一丝幻想，车停在商场周边有人有灯，他不能对我怎样，他说我有两个选择，如果我要打车走他立马办了我，如果我不走他不碰我，我拿出东西马上跑开，他一把搂着我把我硬拽强塞进后排车里，我逃了好几次次次被他拖回来，形形色色很多人没有一个人伸出援手，后面的事情我记不太清了，我精神之前受过刺激，到了某一个顶点程度我会奔溃，我无论怎么奔溃怎么发疯他都没放我走，只是他依然没有得逞，后来我态度也缓和了很多，我求他我说我不跑，我把车开到饭店他同意了。到饭店停车场已经十一点多了，那天下着雨，周边都打烊了，我依然没有跑出去没有侥幸，我一遍遍说着我这么大年纪了求你放过我吧，我求求你。 他说我明天去坐牢我也要上你，我就是馋你身子。我已经绝望了，我知道哭喊和求饶没有任何作用，我说那你能戴套么，他说他没有让我外卖一个，我说我不叫，他说他没病也不在乎我有没有病，我当时精神已经奔溃和绝望。他一把扯下我内裤，我知道我完了，女人被强迫的时候只有深深的恶心，我死命咬着嘴唇不让他亲进来，他强行进入了我，该死的我平时看个老人捡破烂都流泪的人我居然没有哭，我无法形容我当时得感受，绝望恶心还是什么。因为我一直不配合，还一直死命咬他，他身上舌头让我咬了全是青紫色牙印，最后怎么结束的我记不清了，我再一次逃下车，这次他只跟着我没阻拦，我上车后马上锁上门开车而逃，他从后面开车跟着我，我怕他知道我的住处一直绕路画圈，他给我打电话问ktv名字说他耳机掉那了，他才没在跟着我，我不知道怎么开回家的，一遍遍清洗自己身体，我很脏 我没有去报警，虽然我一直恐吓他。他最后没有射出来我不知道能不能留下他的证据。回来后我把他微信游戏全部删掉，他加了我好几次说他错了他喜欢我之类的。我只觉得恶心。这件事过去两天了，白天我还能算正常和同事交流。但是一直阴着脸气色不好，我不敢和任何人说。我是去见网友了，第一次见面被强奸了，我穿的到脚裸长裙，我以为大家都是普通的正常人。我不知道为什么我的生活已经这么苦了还要被命运怎么对待。\", \"type\": \"text\"}','2022-11-07 15:26:02',2311000002,'bnX2UF5tEe2vc0YouK5zcQ','2022-11-07 15:26:01'),(5957,43,10041,'{\"text\": \"&lt;br&gt;fsadf\", \"type\": \"text\", \"reference\": 5956}','2022-11-07 15:26:13',2311000003,'dWfyqV5tEe2vc0YouK5zcQ','2022-11-07 15:26:13'),(5958,43,10041,'{\"text\": \"&lt;br&gt;\", \"type\": \"text\"}','2022-11-07 15:26:22',2311000004,'exot-l5tEe2vc0YouK5zcQ','2022-11-07 15:26:22'),(5959,43,10041,'{\"text\": \"就相当于 ref(\'lemon\')\", \"type\": \"text\"}','2022-11-07 15:26:59',2311000005,'kRxoJl5tEe2vc0YouK5zcQ','2022-11-07 15:26:59'),(5960,43,10041,'{\"text\": \"&lt;br/&gt;fsadf\", \"type\": \"text\", \"reference\": 5959}','2022-11-07 15:27:18',2311000006,'nHWRKl5tEe2vc0YouK5zcQ','2022-11-07 15:27:18'),(5961,43,10041,'{\"text\": \"hfjsdhf<br><br>casdf<br>\", \"type\": \"text\", \"