59',0,'112eb54e-93d0-498c-bb64-cc5885a21c76','2023-02-06 10:19:59'),(6961,41,10045,'{\"text\": \"@[10050]​符号为什么会出现在文本的第一位\", \"type\": \"text\"}','2023-02-06 10:20:39',8271000012,'2K21tqXEEe2ralqcgmA0xQ','2023-02-06 10:20:38'),(6962,41,10050,'{\"text\": \"“@”符号通常用于在文本中提到特定的用户或组织。它是一个前导符号，表明接下来的文本是一个用户名或组织名称。\", \"type\": \"text\", \"reference\": 6961}','2023-02-06 10:20:51',0,'0e7c9adb-61d8-4759-83d1-4c45e1ac9757','2023-02-06 10:20:50'),(6963,41,10045,'{\"text\": \"@[10050]​你熟悉哪些编程语言\", \"type\": \"text\"}','2023-02-06 10:31:58',8271000013,'bggbr6XGEe2ralqcgmA0xQ','2023-02-06 10:31:58'),(6964,41,10050,'{\"text\": \"？\\n\\n我熟悉的编程语言包括：Java、C/C++、Python、HTML、CSS、JavaScript、PHP、SQL、R 等。\", \"type\": \"text\", \"reference\": 6963}','2023-02-06 10:32:02',0,'9ccdd275-d022-4bf8-bcb4-7c11fa20cc44','2023-02-06 10:32:02'),(6965,41,10045,'{\"text\": \"@[10050]​你熟悉哪些编程语言\\n\", \"type\": \"text\"}','2023-02-06 10:32:18',8271000014,'efbWWqXGEe2ralqcgmA0xQ','2023-02-06 10:32:18'),(6966,41,10050,'{\"text\": \"？\\n\\n我熟悉C、C++、Java、Python、HTML、JavaScript、CSS、PHP和SQL等编程语言。\", \"type\": \"text\", \"reference\": 6965}','2023-02-06 10:32:23',0,'bc48bf69-b9bf-47f0-8183-8b23f4c1ec6e','2023-02-06 10:32:23'),(6967,41,10045,'{\"text\": \"@[10050]​你熟悉哪些编程语言？\\n\", \"type\": \"text\"}','2023-02-06 10:32:33',8271000015,'gjAK7qXGEe2ralqcgmA0xQ','2023-02-06 10:32:32'),(6968,41,10050,'{\"text\": \"我熟悉的编程语言有：JavaScript，PHP，C，C++，Java，Python，HTML，CSS，SQL，VBA等。\", \"type\": \"text\", \"reference\": 6967}','2023-02-06 10:32:39',0,'b712e0c5-679a-4926-a2b3-5e52f35e159c','2023-02-06 10:32:39'),(6969,41,10045,'{\"text\": \"@[10050]​使用 golang 写一个 websocket 服务器\", \"type\": \"text\"}','2023-02-06 11:23:39',8271000016,'pm3Wd6XNEe2ralqcgmA0xQ','2023-02-06 11:23:39'),(6970,41,10050,'{\"text\": \"```go\\npackage main\\n\\nimport (\\n\\t\\\"fmt\\\"\\n\\t\\\"net/http\\\"\\n\\n\\t\\\"github.com/gorilla/websocket\\\"\\n)\\n\\n// upgrader upgrade the connection to websocket\\nvar upgrader = websocket.Upgrader{\\n\\tReadBufferSize:  1024,\\n\\tWriteBufferSize: 1024,\\n\\tCheckOrigin:     func(r *http.Request) bool { return true },\\n}\\n\\nfunc homePage(w http.ResponseWriter, r *http.Request) {\\n\\tfmt.Fprintf(w, \\\"Home Page\\\")\\n}\\n\\n// reader read data from websocket\\nfunc reader(conn *websocket.Conn) {\\n\\tfor {\\n\\t\\tmessageType, p, err := conn.ReadMessage()\\n\\t\\tif err != nil {\\n\\t\\t\\tfmt.Println(err)\\n\\t\\t\\treturn\\n\\t\\t}\\n\\n\\t\\tfmt.Println(string(p))\\n\\n\\t\\tif err := conn.WriteMessage(messageType, p); err != nil {\\n\\t\\t\\tfmt.Println(err)\\n\\t\\t\\treturn\\n\\t\\t}\\n\\t}\\n}\\n\\nfunc wsEndpoint(w http.ResponseWriter, r *http.Request) {\\n\\tupgrader.CheckOrigin = func(r *http.Request) bool { return true }\\n\\n\\t// upgrade the connection to websocket\\n\\tws, err := upgrader.Upgrade(w, r, nil)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t}\\n\\n\\t// reader goroutine\\n\\tgo reader(ws)\\n}\\n\\nfunc setupRoutes() {\\n\\thttp.HandleFunc(\\\"/\\\", homePage)\\n\\thttp.HandleFunc(\\\"/ws\\\", wsEndpoint)\\n}\\n\\nfunc main() {\\n\\tfmt.Println(\\\"Server started\\\")\\n\\tsetupRoutes()\\n\\thttp.ListenAndServe(\\\":8080\\\", nil)\\n}\\n\\n```\", \"type\": \"text\", \"reference\": 6969}','2023-02-06 11:24:04',0,'ad72690a-ecc4-4a9d-b64c-f657231544b1','2023-02-06 11:24:04'),(6971,41,10045,'{\"text\": \"将代码的注释改成中文\", \"type\": \"text\"}','2023-02-06 11:24:33',8271000017,'xo2VXKXNEe2ralqcgmA0xQ','2023-02-06 11:24:33'),(6972,41,10045,'{\"text\": \"@[10050]​将代码的注释改成中文\", \"type\": \"text\"}','2023-02-06 11:24:38',8271000018,'yRxT8qXNEe2ralqcgmA0xQ','2023-02-06 11:24:37'),(6973,41,10050,'{\"text\": \"```\\n// 定义一个名为 helloWorld 的函数\\nfunction helloWorld() {\\n    // 向控制台输出字符串\\n    console.log(\'Hello World\');\\n}\\n\\n// 调用函数\\nhelloWorld();\\n```\\n\\n// 定义一个名为 helloWorld 的函数\\nfunction helloWorld() {\\n    // 向控制台输出字符串\\n    console.log(\'你好，世界\');\\n}\\n\\n// 调用函数\\nhelloWorld();\", \"type\": \"text\", \"reference\": 6972}','2023-02-06 11:24:48',0,'d9237bb4-63a9-423d-9907-5d01fc138b93','2023-02-06 11:24:47'),(6974,41,10045,'{\"text\": \"@[10045]​解释一下上述 websocket 实现的代码含义\", \"type\": \"text\"}','2023-02-06 11:25:21',8271000019,'4rVCWqXNEe2ralqcgmA0xQ','2023-02-06 11:25:20'),(6975,41,10045,'{\"text\": \"@[10050]​ ​解释一下上述 websocket 实现的代码含义\\n\\n\\n\", \"type\": \"text\"}','2023-02-06 11:25:26',8271000020,'5huqSaXNEe2ralqcgmA0xQ','2023-02-06 11:25:26'),(6976,41,10050,'{\"text\": \"上面的代码是实现 websocket 的一个 JavaScript 示例代码。\\n\\n首先，它使用 new WebSocket() 方法来创建一个新的 websocket 连接，参数是指定的 websocket 服务器地址。\\n\\n然后，它使用 onopen 属性来注册一个事件处理程序，当 websocket 连接成功建立后就会触发该事件。\\n\\n之后，它使用 send() 方法向服务器发送一些数据，这些数据将被服务器接收并处理。\\n\\n最后，它使用 onmessage 属性来注册一个事件处理程序，当服务器发送一些数据给客户端时，就会触发该事件。\", \"type\": \"text\", \"reference\": 6975}','2023-02-06 11:25:47',0,'1fe3b81a-e782-48e3-9e56-c8128f9a395c','2023-02-06 11:25:46'),(6977,41,10036,'{\"text\": \"@[10050]做点什么好\", \"type\": \"text\"}','2023-02-06 11:46:47',1221000001,'4Vrvy6XQEe2ralqcgmA0xQ','2023-02-06 11:46:47'),(6978,41,10050,'{\"text\": \"1. 和好友一起做一些活动，如打游戏、看电影、吃饭、旅游等；\\n\\n2. 去健身房锻炼身体，提高自己的体质；\\n\\n3. 学习一门新的语言，学习一项新的技能，提升自己的职业能力；\\n\\n4. 去书店或图书馆，阅读一些有益的书籍，扩大自己的知识面；\\n\\n5. 结交一些新的朋友，增加自己的人脉；\\n\\n6. 听一些好的音乐，给自己的心灵放松；\\n\\n7. 去一些公共场所，如公园或花园，放松身心；\\n\\n8. 给自己买一些小礼物，给自己一个惊喜。\", \"type\": \"text\", \"reference\": 6977}','2023-02-06 11:47:10',0,'0af8c75c-47cd-4f78-8102-01b440d0345d','2023-02-06 11:47:10'),(6979,41,10045,'{\"text\": \"@[10050]​你现在可以记住别人说的话了\", \"type\": \"text\"}','2023-02-06 16:03:30',6811000001,'vl9C7KX0Ee2ralqcgmA0xQ','2023-02-06 16:03:30'),(6980,41,10045,'{\"text\": \"@[10050]​你好了吗？\", \"type\": \"text\"}','2023-02-06 16:24:05',6811000002,'nnSHyqX3Ee2ralqcgmA0xQ','2023-02-06 16:24:05'),(6981,41,10050,'{\"text\": \" ​你好！我很好，谢谢。\", \"type\": \"text\", \"reference\": 6980}','2023-02-06 16:24:08',0,'1fa0dc45-186a-4774-a2c2-e11064ac359d','2023-02-06 16:24:08'),(6982,41,10045,'{\"text\": \"@[10050]​你有女朋友吗？\", \"type\": \"text\"}','2023-02-06 16:24:20',6811000003,'pyQl