ing(msg)) if err = ws.WriteMessage(msgType, msg); err != nil { fmt.Println(err) break } } }) http.ListenAndServe(\\\":8080\\\", nil) }\", \"type\": \"text\", \"reference\": 7014}','2023-02-06 16:32:45',0,'4c27828a-1038-40af-b847-e5e34480a053','2023-02-06 16:32:45'),(7016,41,10045,'{\"text\": \"可以调整一下缩进吗？@[10050]\", \"type\": \"text\"}','2023-02-06 16:33:26',6811000016,'7L9jlKX4Ee2ralqcgmA0xQ','2023-02-06 16:33:26'),(7017,41,10050,'{\"text\": \" 你好，我可以调整一下缩进，你有特定的格式要求吗？\", \"type\": \"text\", \"reference\": 7016}','2023-02-06 16:33:31',0,'ba21004c-69d8-4809-8bed-71f3fbcdbce2','2023-02-06 16:33:30'),(7018,41,10045,'{\"text\": \"@[10050]​没有特定要求，请把上述代码按照GoFmt格式写出来\", \"type\": \"text\"}','2023-02-06 16:34:12',6811000017,'CDIzvKX5Ee2ralqcgmA0xQ','2023-02-06 16:34:12'),(7019,41,10050,'{\"text\": \" 你好，我可以按照GoFmt格式重写上述代码：package main import ( \\\"fmt\\\" \\\"net/http\\\" \\\"github.com/gorilla/websocket\\\" ) var upgrader = websocket.Upgrader{} // upgrade connection func upgrade(w http.ResponseWriter, r *http.Request) (*websocket.Conn, error) { conn, err := upgrader.Upgrade(w, r, nil) if err != nil { fmt.Println(err) return nil, err } return conn, nil } func main() { http.HandleFunc(\\\"/\\\", func(w http.ResponseWriter, r *http.Request) { ws, err := upgrade(w, r) if err != nil { fmt.Println(err) } for { msgType, msg, err := ws.ReadMessage() if err != nil { fmt.Println(err) break } fmt.Println(string(msg)) if err = ws.WriteMessage(msgType, msg); err != nil { fmt.Println(err) break } } }) http.ListenAndServe(\\\":8080\\\", nil) }\", \"type\": \"text\", \"reference\": 7018}','2023-02-06 16:34:23',0,'aa87a409-2eba-4b49-9ca4-93115b1b7154','2023-02-06 16:34:23'),(7020,41,10036,'{\"text\": \"缩进被你吃了\", \"type\": \"text\"}','2023-02-06 16:35:37',3768000005,'OtXWqKX5Ee2ralqcgmA0xQ','2023-02-06 16:35:37'),(7021,41,10045,'{\"text\": \"@[10050]​请添加代码让 ReadMessage 的循环可以在读到 \\\"bye\\\" 消息时推出循环\", \"type\": \"text\"}','2023-02-06 16:36:04',6811000018,'Sz_lF6X5Ee2ralqcgmA0xQ','2023-02-06 