计是一项非常重要的任务，它可以帮助开发人员建立一个高效的软件系统。软件设计是一个复杂的过程，需要许多考虑，包括设计的可行性，可扩展性，可维护性，可测试性，可用性，可扩展性，可维护性，可调试性，可安全性，可维护性，可可用性，可可移植性等。\\n\\n软件设计可以按照不同的模型来进行。可以按照设计模式，结构模式，框架模式，控制模式，安全模式，可调试模式，可扩展模式，可维护模式，可移植模式，可可用模式等来实现。每种模式都有其独特的优势，可以满足不同的需求。\\n\\n此外，软件设计还应该包括软件开发的过程，包括需求分析，系统分析，设计，编码，测试，部署等环节。在软件开发中，需要考虑到软件系统的可行性，安全性，可维护性，可扩展性，可可移植性，可可用性，可可测试性等因素。\\n\\n软件设计还应考虑到用户体验，以及如何改善用户体验，例如使用友好的界面，容易操作的控件，可读性强的文档等。\\n\\n软件设计的过程中还应注意软件的可扩展性，可维护性，可可移植性，安全性，可调试性，可可用性等因素。应该确保软件的可扩展性，可维护性，可可移植性，可可用性，可可测试性等都能够达到最高水平。\\n\\n总之，软件设计是一项复杂的任务，需要考虑到许多因素，包括可行性，可扩展性，可维护性，可测试性，可可移植性，可可用性，可安全性，可调试性等。此外，还需要考虑用户体验的因素，以及如何提高软件的可维护性，可扩展性，可可移植性，可可用性，可可测试性等。软件设计是一个复杂的过程，需要许多考虑，以确保开发出一款高质量的软件系统。\", \"type\": \"text\", \"reference\": 7329}','2023-02-08 12:56:19',0,'05b931c7-dd3b-4f2a-9b58-783c15b67a85','2023-02-08 12:56:19'),(7331,41,10045,'{\"text\": \"@[10050]​如何减肥\", \"type\": \"text\"}','2023-02-08 12:56:55',1348000004,'AkCpL6dtEe2nHOpEfxIhvw','2023-02-08 12:56:54'),(7332,41,10050,'{\"text\": \"减肥有很多方法，但是最重要的是要有一个健康的饮食和运动计划。\\n\\n首先，应该开始尝试减少摄入的卡路里，尤其是摄入的糖分。应该尽可能每天摄入2000卡路里，并且尽量避免摄入糖分，这样可以有效减少摄入的热量，从而减肥。\\n\\n其次，应该开始增加运动量，每天至少应该运动30分钟以上。运动可以帮助你增加新陈代谢，从而帮助减肥。\\n\\n此外，也可以通过改变饮食习惯来帮助减肥，例如每天吃5-6餐，比如早餐，午餐，晚餐，加上两个小吃，这样可以有效减少体内贮存的脂肪。\\n\\n通过以上几点，可以有效帮助你减肥。但是，还要注意不要使用任何不安全的方法减肥，例如使用减肥药物，或者减少饮食摄入量到非常低的水平，因为这样可能会对你的身体带来负面影响。\", \"type\": \"text\", \"reference\": 7331}','2023-02-08 12:57:44',0,'9b7d6960-307e-4252-8d1e-0abcb28963f6','2023-02-08 12:57:43'),(7333,41,10045,'{\"text\": \"@[10050]​再具体点\", \"type\": \"text\"}','2023-02-08 12:58:18',1348000005,'M6hiEadtEe2nHOpEfxIhvw','2023-02-08 12:58:17'),(7334,41,10050,'{\"text\": \"具体来说，可以尝试减少摄入的油脂，特别是饱和脂肪，可以尝试多吃水果、蔬菜和全谷物，这样能够提供身体所需的营养，又不会摄入太多卡路里。\\n\\n另外，也可以试着少吃多油多盐的食物，例如炸薯条，汉堡，披萨等，这样可以帮助减少摄入的卡路里。\\n\\n此外，还可以尝试每天的运动，例如散步、慢跑、跳绳等，这样可以帮助你增加新陈代谢，从而有助于减肥。\\n\\n最后，可以尝试使用一些健康减肥产品，如减肥茶、减肥药物等，可以帮助加快减肥的效果，但也要注意不要过度使用，以免影响身体健康。\", \"type\": \"text\", \"reference\": 7333}','2023-02-08 12:58:40',0,'fbef5603-a826-4ca4-9bf4-4a7683274ea6','2023-02-08 12:58:40'),(7335,41,10045,'{\"text\": \"@[10050]​使用 java vert.x 写一个 MQTT Server\", \"type\": \"text\"}','2023-02-08 12:59:02',1348000006,'TlUf6qdtEe2nHOpEfxIhvw','2023-02-08 12:59:02'),(7336,41,10045,'{\"text\": \"@[10050]​使用 Golang 写一个 websocket 服务器\", \"type\": \"text\"}','2023-02-08 12:59:29',1348000007,'XhlnA6dtEe2nHOpEfxIhvw','2023-02-08 12:59:29'),(7337,41,10050,'{\"text\": \"使用 Java Vert.x 写一个 MQTT Server 需要具备以下几个步骤：\\n\\n1. 搭建 Vert.x 的开发环境，包括安装 Java 环境、Maven 等必需的依赖库；\\n\\n2. 利用 Vert.x 的 HttpServer 模块，搭建一个 MQTT 服务器；\\n\\n3. 创建一个 MQTTClient 来与服务器进行连接，并实现一个简单的消息推送功能；\\n\\n4. 利用 Vert.x 的多线程框架，构建一个可以实时处理多个 MQTT 消息的服务器；\\n\\n5. 将 MQTT 服务器部署到线上环境，并进行负载均衡等性能优化。\", \"type\": \"text\", \"reference\": 7335}','2023-02-08 12:59:44',0,'f3c9e04e-fb30-4ccb-a092-758bebfec179','2023-02-08 12:59:44'),(7338,41,10045,'{\"text\": \"@[10050]​请写代码实现\", \"type\": \"text\"}','2023-02-08 13:00:07',1348000008,'dRcB5adtEe2nHOpEfxIhvw','2023-02-08 13:00:07'),(7339,41,10050,'{\"text\": \"使用 Golang 写一个 websocket 服务器需要按照以下几个步骤：\\n\\n1. 安装 Golang，并配置好相关开发环境；\\n\\n2. 利用 Golang 的 net/http 包，搭建 websocket 服务器；\\n\\n3. 配置 websocket 协议，处理客户端发来的消息；\\n\\n4. 利用 Goroutine 来实现 websocket 服务器的多线程处理；\\n\\n5. 将 websocket 服务器部署到线上环境，并进行负载均衡等性能优化。\", \"type\": \"text\", \"reference\": 7336}','2023-02-08 13:00:14',0,'20ec0f72-f74f-4a00-81c1-4a2df9ff8d99','2023-02-08 13:00:14'),(7340,41,10050,'{\"text\": \"package main\\n\\nimport (\\n\\t\\\"fmt\\\"\\n\\t\\\"net/http\\\"\\n\\t\\\"io/ioutil\\\"\\n)\\n\\nfunc main() {\\n\\turl := \\\"http://www.example.com\\\"\\n\\tresp, err := http.Get(url)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t\\treturn\\n\\t}\\n\\n\\tdefer resp.Body.Close()\\n\\tbody, err := ioutil.ReadAll(resp.Body)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t\\treturn\\n\\t}\\n\\n\\tfmt.Println(string(body))\\n}\", \"type\": \"text\", \"reference\": 7338}','2023-02-08 13:00:22',0,'0333c8b6-efdc-4e86-9013-a87f24d74043','2023-02-08 13:00:22'),(7341,41,10045,'{\"text\": \"@[10050]​请写代码实现\", \"type\": \"text\"}','2023-02-08 13:00:23',1348000009,'fjqd7adtEe2nHOpEfxIhvw','2023-02-08 13:00:22'),(7342,41,10050,'{\"text\": \"package main\\n\\nimport (\\n\\t\\\"fmt\\\"\\n\\t\\\"net/http\\\"\\n\\t\\\"io/ioutil\\\"\\n)\\n\\nfunc main() {\\n\\turl := \\\"http://www.example.com\\\"\\n\\tclient := &http.Client{}\\n\\n\\treq, err := http.NewRequest(\\\"GET\\\", url, nil)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t\\treturn\\n\\t}\\n\\n\\tresp, err := client.Do(req)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t\\treturn\\n\\t}\\n\\n\\tdefer resp.Body.Close()\\n\\tbody, err := ioutil.ReadAll(resp.Body)\\n\\tif err != nil {\\n\\t\\tfmt.Println(err)\\n\\t\\treturn\\n\\t}\\n\\n\\tfmt.Println(string(body))\\n}\", \"type\": \"text\", \"reference\": 7341}','2023-02-08 13:00:34',0,'1f77917c-3873-46a4-8ada-167f066f1af7','2023-02-08 13:00:34'),(7343,41,10045,'{\"text\": \"@[10050]​使用 java vert.x 写一个 MQTT Server\", \"type\": \"text\"}','2023-02-08 13:04:07',1348000010,'A8YmhqduEe2nHOpEfxIhvw','2023-02-08 13:04:06'),(7344,41,10050,'{\"text\": \"可以使用Vert.x MQTT客户端构建一个MQTT服务器，该客户端实现了MQTT协议，支持发布/订阅消息，连接/断开客户端等功能。要使用Java Vert.x，可以使用以下步骤：\\n\\n1. 使用Maven安装Vert.x MQTT客户端依赖项：\\n\\n<dependency>\\n  <groupId>io.vertx</groupId>\\n  <artifactId>vertx-mqtt-client</artifactId>\\n  <version>3.8.0</version>\\n</dependency>\\n\\n2. 创建一个Vert.x MQTT服务器：\\n\\nMqttServer server = MqttServer.create(vertx);\\n\\n3. 设置MQTT服务器的监听端口：\\n\\nserver.endpointHandler(endpoint -> {\\n  // Handle MQTT connection\\n});\\nserver.listen(port, result -> {\\n  if (result.succeeded()) {\\n    System.out.println(\\\"MQTT server is now listening on port \\\" + port);\\n  } else {\\n    System.out.println(\\\"Error starting the MQTT server\\\");\\n  }\\n});\\n\\n4. 处理连接和断开连接事件：\\n\\nendpoint.accept(false);\\nendpoint.disconnectHandler(v -> {\\n  // Handle disconnection\\n});\\n\\n5. 处理发布/订阅消息：\\n\\nendpoint.publishHandler(message -> {\\n  // Handle published message\\n});\\nendpoint.subscribeHandler(subscribe -> {\\n  // Handle subscribed message\\n});\", \"type\": \"text\", \"reference\": 7343}','2023-02-08 13:04:31',0,'06a57775-bc8c-41d2-be9d-4f561e49be8d','2023-02-08 13:04:31'),(7345,41,10045,'{\"text\": \"@[10050]​请用完整代码实现一下\", \"type\": \"text\"}','2023-02-08 13:05:39',1348000011,'Or6rdqduEe2nHOpEfxIhvw','2023-02-08 13:05:39'),(7346,41,10050,'{\"text\": \"import io.vertx.core.Vertx;\\nimport io.vertx.mqtt.MqttServer;\\n\\npublic class MqttServerExample {\\n  public static void main(String[] args) {\\n    Vertx vertx = Vertx.vertx();\\n\\n    // Create MQTT Server\\n    MqttServer server = MqttServer.create(vertx);\\n\\n    // Set the listener port\\n    int port = 1883;\\n    server.endpointHandler(endpoint -> {\\n      // Handle MQTT connection\\n      endpoint.accept(false);\\n\\n      // Handle disconnection\\n      endpoint.disconnectHandler(v -> {\\n        // Handle disconnection\\n      });\\n\\n      // Handle published messages\\n      endpoint.publishHandler(message -> {\\n        // Handle published message\\n      });\\n\\n      // Handle subscribed messages\\n      endpoint.subscribeHandler(subscribe -> {\\n        // Handle subscribed message\\n      });\\n    });\\n    server.listen(port, result -> {\\n      if (result.succeeded()) {\\n        System.out.println(\\\"MQTT server is now listening on port \\\" + port);\\n      } else {\\n        System.out.println(\\\"Error starting the MQTT server\\\");\\n      }\\n    });\\n  }\\n}\", \"type\": \"text\", \"reference\": 7345}','2023-02-08 13:05:54',0,'0c6e87d9-b78b-4348-9038-c5bd6bcd83e8','2023-02-08 13:05:53'),(7347,41,10045,'{\"text\": \"@[10050]​加入发布订阅逻辑\", \"type\": \"text\"}','2023-02-08 13:06:27',1348000012,'V4LK1KduEe2nHOpEfxIhvw','2023-02-08 13:06:27'),(7348,41,10050,'{\"text\": \"import io.vertx.core.Vertx;\\nimport io.vertx.mqtt.MqttServer;\\n\\npublic class MqttServerExample {\\n  public static void main(String[] args) {\\n    Vertx vertx = Vertx.vertx();\\n\\n    // Create MQTT Server\\n    MqttServer server = MqttServer.create(vertx);\\n\\n    // Set the listener port\\n    int port = 1883;\\n    server.endpointHandler(endpoint -> {\\n      // Handle MQTT connection\\n      endpoint.accept(false);\\n\\n      // Handle disconnection\\n      endpoint.disconnectHandler(v -> {\\n        // Handle disconnection\\n      });\\n\\n      // Handle published messages\\n      endpoint.publishHandler(message -> {\\n        // Handle published message\\n      });\\n\\n      // Handle subscribed messages\\n      endpoint.subscribeHandler(subscribe -> {\\n        // Handle subscribed message\\n        subscribe.subscribeTopicFilter(subscribe.topicName(), mqttQoS -> {\\n          endpoint.publish(subscribe.topicName(),\\n            MqttMessage.create()\\n              .setQos(mqttQoS.qosLevel())\\n              .setPayload(\\\"Hello world!\\\".getBytes())\\n              .setRetained(true),\\n            done -> {\\n              if (done.succeeded()) {\\n                System.out.println(\\\"Message published\\\");\\n              }\\n            }\\n          );\\n        });\\n      });\\n    });\\n    server.listen(port, result -> {\\n      if (result.succeeded()) {\\n        System.out.println(\\\"MQTT server is now listening on port \\\" + port);\\n      } else {\\n        System.out.println(\\\"Error starting the MQTT server\\\");\\n      }\\n    });\\n  }\\n}\", \"type\": \"text\", \"reference\": 7347}','2023-02-08 13:06:47',0,'5ba80716-dc5f-418f-b041-ea230a266c14','2023-02-08 13:06:47'),(7349,41,10045,'{\"text\": \"@[10050]​请支持不同topic的消息路由\", \"type\": \"text\"}','2023-02-08 13:08:13',1348000013,'ljz7h6duEe2nHOpEfxIhvw','2023-02-08 13:08:12'),(7350,41,10050,'{\"text\": \"endpoint.subscribeHandler(subscribe -> {\\n  // Handle subscribed message\\n  subscribe.subscribeTopicFilter(subscribe.topicName(), mqttQoS -> {\\n    // Route messages to different topics\\n    String topic = subscribe.topicName();\\n    switch (topic) {\\n      case \\\"topic1\\\":\\n        // Handle topic1 messages\\n        break;\\n      case \\\"topic2\\\":\\n        // Handle topic2 messages\\n        break;\\n      default:\\n        // Handle other topics\\n        break;\\n    }\\n  });\\n});\", \"type\": \"text\", \"reference\": 7349}','2023-02-08 13:08:28',0,'bf8087cc-80ea-4968-a1c2-c162bb9adda1','2023-02-08 13:08:28'),(7351,41,10045,'{\"text\": \"@[10050]​不要枚举主题，要支持不同主题的消息要路由到不同客户端，把完整的逻辑加到代码中\", \"type\": \"text\"}','2023-02-08 13:10:40',1348000014,'7nvFG6duEe2nHOpEfxIhvw','2023-02-08 13:10:40'),(7352,41,10050,'{\"text\": \"问我问题的人太多啦，请等下再问哟~\", \"type\": \"text\", \"reference\": 7351}','2023-02-08 13:11:11',0,'1e68d29f-f209-42f1-be47-f4fd7b954e37','2023-02-08 13:11:11'),(7353,41,10045,'{\"text\": \"@[10050]​​不要枚举主题，要支持不同主题的消息要路由到不同客户端，把完整的逻辑加到代码中\", \"type\": \"text\"}','2023-02-08 13:12:02',1348000015,'H0mKyqdvEe2nHOpEfxIhvw','2023-02-08 13:12:02'),(7354,41,10050,'{\"text\": \"endpoint.subscribeHandler(subscribe -> {\\n  // Handle subscribed message\\n  subscribe.subscribeTopicFilter(subscribe.topicName(), mqttQoS -> {\\n    // Route messages to different topics\\n    String topic = subscribe.topicName();\\n    // Get list of clients subscribed to the topic\\n    List<String> clientIds = getClientsSubscribedToTopic(topic);\\n    // For each client\\n    for (String clientId : clientIds) {\\n      // Route the message to the client\\n      routeMessageToClient(message, clientId);\\n    }\\n  });\\n});\", \"type\": \"text\", \"reference\": 7353}','2023-02-08 13:12:32',0,'d4fd2fe1-b478-4467-acdf-dbf0c7d37617','2023-02-08 13:12:32'),(7355,41,10045,'{\"text\": \"@[10050]​客户端订阅的主题要存起来\", \"type\": \"text\"}','2023-02-08 13:13:18',1348000016,'TFzZDadvEe2nHOpEfxIhvw','2023-02-08 13:13:18'),(7356,41,10050,'{\"text\": \"// Get list of clients subscribed to the topic\\nList<String> clientIds = getClientsSubscribedToTopic(topic);\\n// Store the topic the client is subscribed to\\nstoreSubscribedTopic(clientId, topic);\\n// For each client\\nfor (String clientId : clientIds) {\\n  // Route the message to the client\\n  routeMessageToClient(message, clientId);\\n}\", \"type\": \"text\", \"reference\": 7355}','2023-02-08 13:13:29',0,'34ecaf42-6a93-4785-b754-e426942318e9','2023-02-08 13:13:29'),(7357,41,10045,'{\"text\": \"@[10050]​把这些代码合并回 MQTT Server  的代码中\", \"type\": \"text\"}','2023-02-08 13:13:52',1348000017,'YJSLpKdvEe2nHOpEfxIhvw','2023-02-08 13:13:52'),(7358,41,10050,'{\"text\": \"endpoint.subscribeHandler(subscribe -> {\\n  // Handle subscribed message\\n  subscribe.subscribeTopicFilter(subscribe.topicName(), mqttQoS -> {\\n    // Route messages to different topics\\n    String topic = subscribe.topicName();\\n    // Store the topic the client is subscribed to\\n    storeSubscribedTopic(clientId, topic);\\n    // Get list of clients subscribed to the topic\\n    List<String> clientIds = getClientsSubscribedToTopic(topic);\\n    // For each client\\n    for (String clientId : clientIds) {\\n      // Route the message to the client\\n      routeMessageToClient(message, clientId);\\n    }\\n  });\\n});\", \"type\": \"text\", \"reference\": 7357}','2023-02-08 13:14:01',0,'3a7942c1-fd8d-464f-826d-dd9f281cb80f','2023-02-08 13:14:01'),(7359,41,10045,'{\"text\": \"@[10050]​不要写局部代码，写完整的MQTT Server实现\", \"type\": \"text\"}','2023-02-08 13:14:40',1348000018,'fQptAqdvEe2nHOpEfxIhvw','2023-02-08 13:14:39'),(7360,41,10050,'{\"text\": \"public class MQTTServer {\\n  public void start(){\\n    // Create MQTT server endpoint\\n    MqttEndpoint endpoint = createEndpoint();\\n    // Handle subscribed message\\n    endpoint.subscribeHandler(subscribe -> {\\n      subscribe.subscribeTopicFilter(subscribe.topicName(), mqttQoS -> {\\n        // Route messages to different topics\\n        String topic = subscribe.topicName();\\n        // Store the topic the client is subscribed to\\n        storeSubscribedTopic(clientId, topic);\\n        // Get list of clients subscribed to the topic\\n        List<String> clientIds = getClientsSubscribedToTopic(topic);\\n        // For each client\\n        for (String clientId : clientIds) {\\n          // Route the message to the client\\n          routeMessageToClient(message, clientId);\\n        }\\n      });\\n    });\\n    // Handle other types of messages\\n    // ...\\n    // Start the server\\n    endpoint.listen(listenResult -> {\\n      if (listenResult.succeeded()) {\\n        System.out.println(\\\"MQTT server started!\\\");\\n      } else {\\n        System.err.println(\\\"Failed to start MQTT server!\\\");\\n      }\\n    });\\n  }\\n}\", \"type\": \"text\", \"reference\": 7359}','2023-02-08 13:14:57',0,'7bc48b0c-2535-44c7-9b55-693c5b56f38b','2023-02-08 13:14:57'),(7361,41,10045,'{\"text\": \"@[10050]​写一篇关于MQTT的1000字的论文\", \"type\": \"text\"}','2023-02-08 13:16:04',1348000019,'rzC4_6dvEe2nHOpEfxIhvw','2023-02-08 13:16:04'),(7362,41,10050,'{\"text\": \"MQTT (Message Queuing Telemetry Transport) is a lightweight publish/subscribe messaging protocol designed for the Internet of Things (IoT). It is a machine-to-machine (M2M) communication protocol used to send data between IoT devices and applications. MQTT was created in 1999 by Dr. Andy Stanford-Clark and Arlen Nipper, and is now an ISO standard (ISO/IEC PRF 20922).\\n\\nMQTT is designed to be a lightweight protocol that can be easily implemented on low-power, low-bandwidth devices, such as those found in the IoT. It is based on a publish/subscribe model, where devices and applications can subscribe to topics and receive messages from other devices and applications that have published to those topics. This allows for efficient communication between devices and applications, as only messages of interest need to be sent and received.\\n\\nMQTT is also designed to be secure and reliable. It uses TCP/IP as its transport protocol, which provides a secure connection between devices and applications. It also uses authentication and encryption to ensure that data is secure while in transit.\\n\\nMQTT is easy to implement and use, and can reduce the complexity of connecting devices and applications. It is becoming increasingly popular in the IoT and is used in a variety of applications, such as home automation, industrial automation, and medical devices.\\n\\nIn conclusion, MQTT is an efficient, secure, and reliable messaging protocol that can be used to send data between IoT devices and applications. It is easy to implement and use, and can reduce the complexity of connecting devices and applications. As the number of IoT devices and applications increases, MQTT will become an increasingly important protocol for connecting these devices and applications.\", \"type\": \"text\", \"reference\": 7361}','2023-02-08 13:16:43',0,'b81a905c-c7ad-448f-bb58-9cf3a207bddc','2023-02-08 13:16:43'),(7363,41,10045,'{\"text\": \"@[10050]​把它翻译成中文\", \"type\": \"text\"}','2023-02-08 13:17:20',1348000020,'3KVdiqdvEe2nHOpEfxIhvw','2023-02-08 13:17:20'),(7364,41,10050,'{\"text\": \"MQTT（消息队列遥测传输）是一种轻量级的发布/订阅消息协议，专为物联网（IoT）而设计。它是一种机器到机器（M2M）通信协议，用于在物联网设备和应用之间发送数据。 MQTT于1999年由Andy Stanford-Clark博士和Arlen Nipper创建，现已是ISO标准（ISO / IEC PRF 20922）。\\n\\nMQTT旨在成为一种轻量级协议，可以轻松地在低功耗、低带宽设备上实现，例如物联网中的设备。它基于发布/订阅模型，设备和应用可以订阅主题并接收其他设备和应用程序发布到这些主题的消息。这样可以在设备和应用之间实现高效的通信，因为只需发送和接收感兴趣的消息。\\n\\nMQTT还被设计为安全可靠。它使用TCP / IP作为其传输协议，为设备和应用提供安全的连接。它还使用身份验证和加密来确保数据在传输过程中安全。\\n\\nMQTT易于实施和使用，可以减少连接设备和应用程序的复杂性。它在物联网中越来越受欢迎，并用于各种应用，如家庭自动化、工业自动化和医疗设备。\\n\\n总之，MQTT是一种高效、安全可靠的消息协议，可用于在物联网设备和应用之间发送数据。它易于实施和使用，可以减少连接设备和应用程序的复杂性。随着物联网设备和应用程序数量的增加，MQTT将成为连接这些设备和应用程序的越来越重要的协议。\", \"type\": \"text\", \"reference\": 7363}','2023-02-08 13:18:09',0,'e4163ff7-edca-4a61-8d45-213a8181e01d','2023-02-08 13:18:09'),(7365,41,10045,'{\"text\": \"@[10050]​在不在\", \"type\": \"text\"}','2023-02-08 14:23:28',3949000001,'GbER76d5Ee2nHOpEfxIhvw','2023-02-08 14:23:28'),(7366,41,10050,'{\"text\": \" 我现在不在。\", \"type\": \"text\", \"reference\": 7365}','2023-02-08 14:23:31',0,'70f0a278-2d36-415d-94b7-0519b274bdd4','2023-02-08 14:23:30'),(7367,41,10045,'{\"text\": \"@[10