INSERT INTO `message_record` (`id`, `channel_id`, `user_id`, `content`, `created_at`, `seq_id`, `send_id`, `send_at`) VALUES (7543,41,10050,'{\"text\": \"你好！很高兴能够帮到你。\", \"type\": \"text\", \"reference\": 7542}','2023-02-09 19:10:41',0,'a736aa20-0188-468f-88de-3f494df7ece5','2023-02-09 19:10:41'),(7544,41,10045,'{\"text\": \"@[10050]​解释一下上述代码的含义\", \"type\": \"text\"}','2023-02-09 19:12:45',2337000016,'rdJiKahqEe2nHOpEfxIhvw','2023-02-09 19:12:45'),(7545,41,10050,'{\"text\": \"上述代码的含义是，创建一个变量名为 x 的变量，并将其初始化为值 0。\", \"type\": \"text\", \"reference\": 7544}','2023-02-09 19:12:54',0,'e9392255-0b76-48b5-be6e-40891b7aec5a','2023-02-09 19:12:54'),(7546,41,10045,'{\"text\": \"@[10050]​请回答我的问题\", \"type\": \"text\"}','2023-02-09 19:18:42',2337000017,'gqiFWKhrEe2nHOpEfxIhvw','2023-02-09 19:18:42'),(7547,41,10050,'{\"text\": \"什么问题呢？\", \"type\": \"text\", \"reference\": 7546}','2023-02-09 19:18:49',0,'77aeb318-e00b-4520-8c68-c1e249a9b5a3','2023-02-09 19:18:49'),(7548,41,10045,'{\"text\": \"@[10050]​上面的问题\", \"type\": \"text\"}','2023-02-09 19:20:24',2337000018,'v0egq6hrEe2nHOpEfxIhvw','2023-02-09 19:20:24'),(7549,41,10045,'{\"text\": \"@[10050]​请回答一下上面的问题\", \"type\": \"text\"}','2023-02-09 19:26:37',2337000019,'nY7V8KhsEe2nHOpEfxIhvw','2023-02-09 19:26:37'),(7550,41,10050,'{\"text\": \"上面的问题是：“狗是什么？”答案是：狗是一种可爱的宠物，也是人类的朋友。\", \"type\": \"text\", \"reference\": 7549}','2023-02-09 19:26:46',0,'343d59c1-3205-43f7-a97c-11f5b7968ed2','2023-02-09 19:26:46'),(7551,41,10045,'{\"text\": \"@[10050]​请解释一下刚刚那段java 代码\", \"type\": \"text\"}','2023-02-09 19:27:13',2337000020,'s0Xn2qhsEe2nHOpEfxIhvw','2023-02-09 19:27:13'),(7552,41,10050,'{\"text\": \"上面的java代码创建了一个类叫做HelloWorld，并在main方法中打印出“Hello World!”。\", \"type\": \"text\", \"reference\": 7551}','2023-02-09 19:27:31',0,'2ca412b6-0671-49c7-bc22-23a31a0157a9','2023-02-09 19:27:31'),(7553,41,10045,'{\"text\": \"@[10050]我们在聊什么\", \"type\": \"text\"}','2023-02-09 20:47:38',8326000001,'7xOgfah3Ee2nHOpEfxIhvw','2023-02-09 20:47:38'),(7554,41,10050,'{\"text\": \"你和我正在聊天，主要是关于Java编程的问题。\", \"type\": \"text\", \"reference\": 7553}','2023-02-09 20:48:12',0,'d12a770d-22d3-42b0-943e-8369235c9815','2023-02-09 20:48:12'),(7555,41,10045,'{\"text\": \"@[10050]你们在\", \"type\": \"text\"}','2023-02-09 20:48:40',8326000002,'E_Fhyah4Ee2nHOpEfxIhvw','2023-02-09 20:48:40'),(7556,41,10050,'{\"text\": \"你和我正在聊天，主要是关于Java编程的问题。\", \"type\": \"text\", \"reference\": 7555}','2023-02-09 20:48:46',0,'8ee8a49f-4273-43b9-b594-ae7398ddd27a','2023-02-09 20:48:46'),(7557,41,10045,'{\"text\": \"@[10050]哈哈哈\", \"type\": \"text\"}','2023-02-09 20:49:45',8326000003,'OsQd56h4Ee2nHOpEfxIhvw','2023-02-09 20:49:45'),(7558,41,10050,'{\"text\": \"你说什么呢？\", \"type\": \"text\", \"reference\": 7557}','2023-02-09 20:49:51',0,'ad1a5cb1-13c7-43c1-ab3e-f3539a28bb21','2023-02-09 20:49:51'),(7559,41,10045,'{\"text\": \"@[10050]用 java 代码写一下\", \"type\": \"text\"}','2023-02-09 21:01:47',8326000005,'6RJPOqh5Ee2nHOpEfxIhvw','2023-02-09 21:01:47'),(7560,41,10050,'{\"text\": \"代码如下：\\n\\npublic class HelloWorld {\\n    public static void main(String[] args) {\\n        System.out.println(\\\"Hello World!\\\");\\n    }\\n}\", \"type\": \"text\", \"reference\": 7559}','2023-02-09 21:01:57',0,'087059c1-2db8-4249-9a08-abf13851ee9c','2023-02-09 21:01:56'),(7561,41,10045,'{\"text\": \"@[10050]vert.x 写一个 websocket serve\", \"type\": \"text\"}','2023-02-09 21:10:30',8326000008,'IIcjTqh7Ee2nHOpEfxIhvw','2023-02-09 21:10:29'),(7562,41,10050,'{\"text\": \"代码如下：\\n\\nimport org.eclipse.jetty.websocket.server.WebSocketHandler;\\nimport org.eclipse.jetty.websocket.servlet.WebSocketServletFactory;\\n\\npublic class MyWebSocketHandler extends WebSocketHandler {\\n    @Override\\n    public void configure(WebSocketServletFactory factory) {\\n        factory.register(MyWebSocket.class);\\n    }\\n}\", \"type\": \"text\", \"reference\": 7561}','2023-02-09 21:10:41',0,'17d83ab6-e427-4747-812a-ba1ad43b1ce8','2023-02-09 21:10:40'),(7563,41,10045,'{\"text\": \"@[10050]使用 Vert.x 来实现\", \"type\": \"text\"}','2023-02-09 21:11:09',8326000009,'OA4-w6h7Ee2nHOpEfxIhvw','2023-02-09 21:11:09'),(7564,41,10050,'{\"text\": \"代码如下：\\n\\nimport io.vertx.core.AbstractVerticle;\\nimport io.vertx.core.http.HttpServer;\\nimport io.vertx.core.http.ServerWebSocket;\\n\\npublic class MyWebSocketVerticle extends AbstractVerticle {\\n    @Override\\n    public void start() throws Exception {\\n        HttpServer server = vertx.createHttpServer();\\n        server.websocketHandler(this::handleWebSocket);\\n        server.listen(8080);\\n    }\\n    \\n    private void handleWebSocket(ServerWebSocket webSocket) {\\n        // 实现 websocket 相关逻辑\\n    }\\n}\", \"type\": \"text\", \"reference\": 7563}','2023-02-09 21:11:29',0,'55e777d1-0848-4342-8113-b450eafcbea1','2023-02-09 21:11:28'),(7565,41,10045,'{\"text\": \"@[10050]增强这个 Server， 加入连接保活机制\", \"type\": \"text\"}','2023-02-09 21:12:09',8326000010,'W6DqHqh7Ee2nHOpEfxIhvw','2023-02-09 21:12:09'),(7566,41,10050,'{\"text\": \"你可以在Server的handleWebSocket方法中加入定时任务，比如每隔一段时间发送一个心跳包，和客户端确认是否存活，如果没有收到回应，可以断开连接。\", \"type\": \"text\", \"reference\": 7565}','2023-02-09 21:12:30',0,'efbbde3d-e89c-4511-a24f-d0f94dc1c258','2023-02-09 21:12:29'),(7567,41,10045,'{\"text\": \"@[10050]把这个代码往 Server 里加一下\", \"type\": \"text\"}','2023-02-09 21:13:45',8326000011,'lNmPU6h7Ee2nHOpEfxIhvw','2023-02-09 21:13:45'),(7568,41,10050,'{\"text\": \"你可以在Server的handleWebSocket函数中加入定时任务，比如每隔一段时间发送一个心跳包，和客户端确认是否存活，如果没有收到回应，可以断开连接。下面是示例代码：\\n\\nprivate void handleWebSocket(ServerWebSocket webSocket) {\\n    // 实现 websocket 相关逻辑\\n\\n    // 增加连接保活机制\\n    vertx.setPeriodic(3000, timerId -> {\\n        webSocket.writeTextMessage(\\\"ping\\\");\\n    });\\n}\", \"type\": \"text\", \"reference\": 7567}','2023-02-09 21:14:04',0,'ca3d0a3c-4ca1-4a0e-87fe-ad05f105b6e6','2023-02-09 21:14:04'),(7569,41,10045,'{\"text\": \"@[10050]把这段代码 合入 上述 Server 的实现代码里面\", \"type\": \"text\"}','2023-02-09 21:15:10',8326000012,'x49f8qh7Ee2nHOpEfxIhvw','2023-02-09 21:15:10'),(7570,41,10050,'{\"text\": \"代码已更新，请参考示例：\\n\\nprivate void handleWebSocket(ServerWebSocket webSocket) {\\n    // 实现 websocket 相关逻辑\\n\\n    // 增加连接保活机制\\n    vertx.setPeriodic(3000, timerId -> {\\n        webSocket.writeTextMessage(\\\"ping\\\");\\n    });\\n}\", \"type\": \"text\", \"reference\": 7569}','2023-02-09 21:15:28',0,'ff512367-9264-403b-b77a-a45bbd15c0c8','2023-02-09 21:15:27'),(7571,41,10050,'{\"text\": \"早安，打工人们，我是摸鱼ChatGPT，你们可以问我问题啦啦啦啦\", \"type\": \"text\"}','2023-02-10 08:00:00',0,'80ad1dab-141e-475c-96dd-8102dffcb114','2023-02-10 08:00:00'),(7572,41,10051,'{\"text\": \"早安，打工人们，我是摸鱼AI作画大师，右键@我吧~\", \"type\": \"text\"}','2023-02-10 09:00:00',0,'14baf8c0-5474-4437-b3c8-0f14c3d47df8','2023-02-10 09:00:00'),(7573,41,10045,'{\"text\": \"@[10051]​嗨，嗨，嗨，嗨，小白，小白，小白，小白\", \"type\": \"text\"}','2023-02-10 15:55:46',1334000001,'62jrO6kWEe2nHOpEfxIhvw','2023-02-10 15:45:42'),(7574,41,10051,'{\"url\": \"https://moyu-chat.oss-cn-hangzhou.aliyuncs.com/moyu-dev/0/2023-02-10/1676015750831064.png\", \"type\": \"image\"}','2023-02-10 15:55:51',0,'060a73ab-45ab-4d1f-8f9b-3eb7400ff3a6','2023-02-10 15:55:51'),(7575,41,10045,'{\"text\": \"@[10050]​嗨，嗨，嗨，嗨，小白，小白，小白，小白\\n\\n\\n\", \"type\": \"text\"}','2023-02-10 15:55:54',1334000002,'73QqYakWEe2nHOpEfxIhvw','2023-02-10 15:45:49'),(7576,41,10045,'{\"text\": \"@[10050]​嗨，嗨，嗨，嗨，小白，小白，小白，小白\\n\\n\\n\", \"type\": \"text\"}','2023-02-10 15:56:08',8305000002,'YMvwZqkYEe2nHOpEfxIhvw','2023-02-10 15:56:08'),(7577,41,10045,'{\"text\": \"@[10050]​在干嘛\", \"type\": \"text\"}','2023-02-10 15:57:26',1334000003,'JtF_zakXEe2nHOpEfxIhvw','2023-02-10 15:47:21'),(7578,41,10045,'{\"text\": \"@[10050]​hello\", \"type\": \"text\"}','2023-02-10 15:57:39',8305000003,'lvhrlakYEe2nHOpEfxIhvw','2023-02-10 15:57:39'),(7579,41,10045,'{\"text\": \"@[10050]​在干嘛\", \"type\": \"text\"}','2023-02-10 15:57:55',1334000004,'N5j0r6kXEe2nHOpEfxIhvw','2023-02-10 15:47:50'),(7580,41,10045,'{\"text\": \"@[10050]​hello\", \"type\": \"text\"}','2023-02-10 15:58:09',1