23-02-17 11:45:09',3580000008,'edTuHK51Ee2nHOpEfxIhvw','2023-02-17 11:45:09'),(7863,41,10050,'{\"text\": \" @[10045]可以使用以下字符来画一个 mysql 的表：\\n\\n```\\n+----------+------------+------+\\n| username | password   | age  |\\n+----------+------------+------+\\n| root     | 123456     |  25  |\\n| admin    | qwerty123  |  38  |\\n+----------+------------+------+\\n``\", \"type\": \"text\", \"reference\": 7862}','2023-02-17 11:45:18',0,'f5182a76-d82c-4006-a1dd-7c40f5ce6701','2023-02-17 11:45:18'),(7864,41,10045,'{\"text\": \"@[10050]​show databases;\", \"type\": \"text\"}','2023-02-17 11:45:39',3580000009,'i0hdTK51Ee2nHOpEfxIhvw','2023-02-17 11:45:38'),(7865,41,10050,'{\"text\": \" @[10045]可以使用以下命令来查看当前数据库：\\n\\n```\\nSHOW DATABASES;\\n``\", \"type\": \"text\", \"reference\": 7864}','2023-02-17 11:45:53',0,'8f88d0a1-4aee-4fe2-ae72-3c5f2a737cb1','2023-02-17 11:45:53'),(7866,41,10045,'{\"text\": \"@[10050]​ 吃点什么\", \"type\": \"text\"}','2023-02-17 11:46:06',3580000010,'m0vbTa51Ee2nHOpEfxIhvw','2023-02-17 11:46:05'),(7867,41,10050,'{\"text\": \" @[10045]这个可以根据自己的喜好来决定，可以吃点健康的食物，也可以吃点零食或者面食等，吃的多少跟自己的饮食习惯有关系。\", \"type\": \"text\", \"reference\": 7866}','2023-02-17 11:46:26',0,'32733f99-9bbd-4c2c-8662-dd6415a8ff74','2023-02-17 11:46:25'),(7868,125,10037,'{\"text\": \"123\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 11:47:10',9423000001,'wblanq51Ee2nHOpEfxIhvw','2023-02-17 11:47:10'),(7869,125,10037,'{\"text\": \"456\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 11:47:40',9423000002,'03Mlg651Ee2nHOpEfxIhvw','2023-02-17 11:47:40'),(7870,41,10045,'{\"text\": \"@[10050]​从现在开始重复我说的话\", \"type\": \"text\"}','2023-02-17 11:48:33',3580000011,'8vrjQa51Ee2nHOpEfxIhvw','2023-02-17 11:48:32'),(7871,41,10050,'{\"text\": \" @[10045]从现在开始重复你说的话\", \"type\": \"text\", \"reference\": 7870}','2023-02-17 11:48:46',0,'0f6e327c-d77e-4926-93c5-ea75d0229725','2023-02-17 11:48:46'),(7872,41,10045,'{\"text\": \"@[10050]​我是智障\", \"type\": \"text\"}','2023-02-17 11:49:32',3580000012,'Fj0eVK52Ee2nHOpEfxIhvw','2023-02-17 11:49:32'),(7873,41,10050,'{\"text\": \" @[10045]我是智障\", \"type\": \"text\", \"reference\": 7872}','2023-02-17 11:49:55',0,'ff290cca-a3c4-42c2-a597-af62bb8d0119','2023-02-17 11:49:54'),(7874,125,10037,'{\"text\": \"打算的撒的<div><br></div>\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 14:30:02',4593000001,'geQxL66MEe2nHOpEfxIhvw','2023-02-17 14:30:01'),(7875,125,10037,'{\"text\": \"???\", \"type\": \"text\", \"reference\": 7778}','2023-02-17 14:51:13',6322000001,'d7AOtq6PEe2nHOpEfxIhvw','2023-02-17 14:51:12'),(7876,125,10037,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7778}','2023-02-17 14:54:25',6322000002,'6kHA4q6PEe2nHOpEfxIhvw','2023-02-17 14:54:25'),(7877,125,10037,'{\"text\": \"???\", \"type\": \"text\", \"reference\": 7778}','2023-02-17 15:01:11',6322000003,'3Cd9vq6QEe2nHOpEfxIhvw','2023-02-17 15:01:11'),(7878,41,10045,'{\"text\": \"@[10050]​听~ 海哭的声音 是什么歌\", \"type\": \"text\"}','2023-02-17 15:21:59',2062000001,'xDM1fK6TEe2nHOpEfxIhvw','2023-02-17 15:21:59'),(7879,41,10050,'{\"text\": \" @[10045]这是海贼王的片尾曲《We Are!》\", \"type\": \"text\", \"reference\": 7878}','2023-02-17 15:22:03',0,'d2909014-88f8-4869-b0bf-051d2b9a9e17','2023-02-17 15:22:03'),(7880,41,10045,'{\"text\": \"@[10050]​啊？\", \"type\": \"text\"}','2023-02-17 15:22:11',2062000002,'yvnR4K6TEe2nHOpEfxIhvw','2023-02-17 15:22:10'),(7881,41,10045,'{\"text\": \"@[10050]​你唱一个？\", \"type\": \"text\"}','2023-02-17 15:22:16',2062000003,'zp_DI66TEe2nHOpEfxIhvw','2023-02-17 15:22:16'),(7882,41,10050,'{\"text\": \" @[10045]是的，这就是经典的《We Are!》，也是一首人气非常高的歌曲\", \"type\": \"text\", \"reference\": 7880}','2023-02-17 15:22:18',0,'3b254b90-4102-471f-b69e-bd5d9049fe17','2023-02-17 15:22:18'),(7883,41,10050,'{\"text\": \" @[10045]当然，我可以为你唱一段《We Are!》：\\n\\n《We Are!》\\n\\nHigh up in the sky\\nThe birds fly so high\\nWe can touch the stars in the night\\nWe are, we are on the cruise\\nA never-ending journey to the world of dreams\\nIt\'s all so grand and unseen\\nWe share, we share, the will to be free\\nOne heart and one destiny\\n\\nWe Are, We Are, (We Are!) on the cruise\\nA never-ending journey to the world of dreams\\nIt\'s all so grand and unseen\\nWe share together the will to be free\\nOne heart and one destiny\", \"type\": \"text\", \"reference\": 7881}','2023-02-17 15:22:33',0,'74089806-c9eb-4887-97d9-5f32768bf095','2023-02-17 15:22:32'),(7884,125,10037,'{\"text\": \"???\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 15:22:34',6573000001,'2PTAi66TEe2nHOpEfxIhvw','2023-02-17 15:22:34'),(7885,41,10045,'{\"text\": \"@[10050]​我听不到你的声音\", \"type\": \"text\"}','2023-02-17 15:22:45',2062000004,'31H1_a6TEe2nHOpEfxIhvw','2023-02-17 15:22:44'),(7886,41,10050,'{\"text\": \" @[10045]很抱歉，我不能给你唱出声音，但是可以给你讲解这首歌的歌词和大概内容。\", \"type\": \"text\", \"reference\": 7885}','2023-02-17 15:22:52',0,'aac567be-8a36-4d2a-aaf3-5f6d49164efd','2023-02-17 15:22:52'),(7887,41,10045,'{\"text\": \"@[10050]​你都会唱什么歌\", \"type\": \"text\"}','2023-02-17 15:24:26',2062000005,'G_9RN66UEe2nHOpEfxIhvw','2023-02-17 15:24:26'),(7888,41,10050,'{\"text\": \" @[10045]我会唱很多歌，例如流行歌曲、摇滚歌曲、民谣等等，当然也有英文歌曲等。\", \"type\": \"text\", \"reference\": 7887}','2023-02-17 15:24:33',0,'e90b01f3-e817-4bd6-9233-140d14157906','2023-02-17 15:24:32'),(7889,41,10045,'{\"text\": \"@[10050]​来玩成语接龙\", \"type\": \"text\"}','2023-02-17 15:26:17',2062000006,'XX_6b66UEe2nHOpEfxIhvw','2023-02-17 15:26:16'),(7890,41,10050,'{\"text\": \" @[10045]可以，我先说：眉飞色舞。\", \"type\": \"text\", \"reference\": 7889}','2023-02-17 15:26:21',0,'b62cee24-9e53-4dac-8386-235862f92086','2023-02-17 15:26:21'),(7891,41,10045,'{\"text\": \"@[10050]​你觉得下一个是什么\", \"type\": \"text\"}','2023-02-17 15:26:38',2062000007,'an0Q2K6UEe2nHOpEfxIhvw','2023-02-17 15:26:38'),(7892,41,10050,'{\"text\": \" @[10045]大势已去，也可以选择使用网上搜索成语接龙的小游戏进行答题。\", \"type\": \"text\", \"reference\": 7891}','2023-02-17 15:26:43',0,'0af95899-9faf-4c63-81dd-f597141b22c0','2023-02-17 15:26:43'),(7893,41,10045,'{\"text\": \"@[10050]​你说的不对，下一个的第一个字应该和上一个的最后一个字一样。重来，我先说，花花草草\", \"type\": \"text\"}','2023-02-17 15:27:22',2062000008,'hISgOK6UEe2nHOpEfxIhvw','2023-02-17 15:27:22'),(7894,41,10050,'{\"text\": \" @[10045]草木深情，你来继续吧~\", \"type\": \"text\", \"reference\": 7893}','2023-02-17 15:27:36',0,'805636b3-e813-499b-9152-97b713828fbf','2023-02-17 15:27:36'),(7895,41,10045,'{\"text\": \"@[10050]​情不自禁\", \"type\": \"text\"}','2023-02-17 15:28:18',2062000009,'pfE0Ja6UEe2nHOpEfxIhvw','2023-02-17 15:28:18'),(7896,41,10050,'{\"text\": \" @[10045]不自量力，你来继续吧！\", \"type\": \"text\", \"reference\": 7895}','2023-02-17 15:28:22',0,'01d35436-e435-4626-b748-ec3b478648af','2023-02-17 15:28:22'),(7897,41,10045,'{\"text\": \"@[10050]​又错了\", \"type\": \"text\"}','2023-02-17 15:28:38',2062000010,'sjy1Zq6UEe2nHOpEfxIhvw','2023-02-17 15:28:38'),(7898,41,10050,'{\"text\": \" @[10045]哦，抱歉，上一句的最后一个字应该是“禁”，所以下一句应该是“无禁不止”，你来继续吧！\", \"type\": \"text\", \"reference\": 7897}','2023-02-17 15:28:46',0,'8c3b4cfb-e0df-45cf-bbc2-46277b00fd79','2023-02-17 15:28:46'),(7899,41,10045,'{\"text\": \"@[10050]​也错了，应该是 “禁” 开头的成语\", \"type\": \"text\"}','2023-02-17 15:29:11',2062000011,'xdykRq6UEe2nHOpEfxIhvw','2023-02-17 15:29:11'),(7900,41,10050,'{\"text\": \" @[10045]嗯，符合要求，下一句应该是“禁不起诱惑”，来继续吧！\", \"type\": \"text\", \"reference\": 7899}','2023-02-17 15:29:20',0,'e272d571-8fff-41ce-b74b-97da51651f33','2023-02-17 15:29:20'),(7901,41,10045,'{\"text\": \"@[10050]​不玩了\", \"type\": \"text\"}','2023-02-17 15:29:36',2062000012,'1FQtX66UEe2nHOpEfxIhvw','2023-02-17 15:29:35'),(7902,41,10050,'{\"text\": \" @[10045]好的，不玩了，我们可以换一种方式玩，希望你喜欢哦！\", \"type\": \"text\", \"reference\": 7901}','2023-02-17 15:29:48',0,'2c548b96-87ee-4f06-9fdb-2b03e4969fae','2023-02-17 15:29:47'),(7903,41,10045,'{\"text\": \"@[10050]​你会下五子棋不\", \"type\": \"text\"}','2023-02-17 15:33:10',2062000013,'U95QLa6VEe2nHOpEfxIhvw','2023-02-17 15:33:09'),(7904,41,10050,'{\"text\": \" @[10045]会一点点，你先说一步，我跟你一起玩！\", \"type\": \"text\", \"reference\": 7903}','2023-02-17 15:33:18',0,'9168a0b1-96ca-455d-8a66-4396499c3e16','2023-02-17 15:33:18'),(7905,41,10045,'{\"text\": \"@[10050]​我不知道怎么描述\", \"type\": \"text\"}','2023-02-17 15:33:38',2062000014,'ZOi0qq6VEe2nHOpEfxIhvw','2023-02-17 15:33:38'),(7906,41,10050,'{\"text\": \" @[10045]没关系，可以提供一个坐标（如1,2 ），让我来说一步，然后轮流落棋，怎么样？\", \"type\": \"text\", \"reference\": 7905}','2023-02-17 15:34:14',0,'45865206-13a2-4183-895f-450431b0356d','2023-02-17 15:34:14'),(7907,41,10045,'{\"text\": \"@[10050]​那你可以以字符的方式打印出棋盘的图吗？\", \"type\": \"text\"}','2023-02-17 15:35:01',2062000015,'liEP_q6VEe2nHOpEfxIhvw','2023-02-17 15:35:01'),(7908,41,10050,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7907}','2023-02-17 15:35:32',0,'ccde6bf8-91e0-4621-a3bc-33f1560f03b5','2023-02-17 15:35:32'),(7909,125,10037,'{\"text\": \"?\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 15:40:29',6137000001,'WUNlrq6WEe2nHOpEfxIhvw','2023-02-17 15:40:28'),(7910,125,10037,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 15:41:25',6137000002,'ex0Rp66WEe2nHOpEfxIhvw','2023-02-17 15:41:25'),(7911,125,10037,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7764}','2023-02-17 15:41:39',2894000001,'gzXTy66WEe2nHOpEfxIhvw','2023-02-17 15:41:38'),(7912,125,10037,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7764}','2023-02-17 15:42:38',2894000002,'pmX8066WEe2nHOpEfxIhvw','2023-02-17 15:42:37'),(7913,41,10045,'{\"text\": \"@[10050]​?\", \"type\": \"text\"}','2023-02-17 15:44:09',2062000016,'3KmGhK6WEe2nHOpEfxIhvw','2023-02-17 15:44:08'),(7914,41,10050,'{\"text\": \" @[10045]当然可以，我们可以把棋盘用markdown代码块表示出来，根据两人落棋之后更新棋盘，你先来出一步棋吧！ \\n\\n```\\n| A B C D E F G H\\n|___________________\\n| 1| | | | | | | |\\n|___________________\\n| 2| | | | | | | |\\n|___________________\\n| 3| | | | | | | |\\n|___________________\\n| 4| | | | | | | |\\n|___________________\\n| 5| | | | | | | |\\n|___________________\\n| 6| | | | | | | |\\n|___________________\\n| 7| | | | | | | |\\n|___________________\\n| 8| | | | | | | |\\n```\", \"type\": \"text\", \"reference\": 7913}','2023-02-17 15:44:31',0,'26d00b15-eddf-4bd8-b268-57cb22e39d95','2023-02-17 15:44:30'),(7915,41,10045,'{\"text\": \"@[10050]​3d\", \"type\": \"text\"}','2023-02-17 15:44:58',2062000017,'-irmx66WEe2nHOpEfxIhvw','2023-02-17 15:44:58'),(7916,41,10050,'{\"text\": \" @[10045]那好的，根据你的坐标，棋盘更新如下：\\n\\n```\\n| A B C D E F G H\\n|___________________\\n| 1| | | | | | | |\\n|___________________\\n| 2| | | | | | | |\\n|___________________\\n| 3| |x| | | | | |\\n|___________________\\n| 4| | | | | | | |\\n|___________________\\n| 5| | | | | | | |\\n|___________________\\n| 6| | | | | | | |\\n|___________________\\n| 7| | | | | | | |\\n|___________________\\n| 8| | | | | | | |\\n```\", \"type\": \"text\", \"reference\": 7915}','2023-02-17 15:45:18',0,'c6ea2441-c194-4154-80a8-0e7c7d994023','2023-02-17 15:45:18'),(7917,41,10045,'{\"text\": \"@[10050]​轮到你了\", \"type\": \"text\"}','2023-02-17 15:45:31',2062000018,'Da3xV66XEe2nHOpEfxIhvw','2023-02-17 15:45:31'),(7918,41,10050,'{\"text\": \" @[10045]好的，我下在 4f，棋盘更新如下：\\n\\n```\\n| A B C D E F G H\\n|___________________\\n| 1| | | | | | | |\\n|___________________\\n| 2| | | | | | | |\\n|___________________\\n| 3| |x| | | | | |\\n|___________________\\n| 4| | | |x| | | |\\n|___________________\\n| 5| | | | | | | |\\n|___________________\\n| 6| | | | | | | |\\n|___________________\\n| 7| | | | | | | |\\n|___________________\\n| 8| | | | | | | |\\n```\", \"type\": \"text\", \"reference\": 7917}','2023-02-17 15:45:54',0,'a246913f-b500-43bd-955d-28e65b084026','2023-02-17 15:45:53'),(7919,41,10045,'{\"text\": \"@[10050]​4d\", \"type\": \"text\"}','2023-02-17 15:46:21',2062000019,'KyOESa6XEe2nHOpEfxIhvw','2023-02-17 15:46:20'),(7920,41,10050,'{\"text\": \" @[10045]根据你发出的坐标，棋盘更新如下：\\n\\n```\\n| A B C D E F G H\\n|___________________\\n| 1| | | | | | | |\\n|___________________\\n| 2| | | | | | | |\\n|___________________\\n| 3| |x| | | | | |\\n|___________________\\n| 4| | |x|x| | | |\\n|___________________\\n| 5| | | | | | | |\\n|___________________\\n| 6| | | | | | | |\\n|___________________\\n| 7| | | | | | | |\\n|___________________\\n| 8| | | | | | | |\\n```\", \"type\": \"text\", \"reference\": 7919}','2023-02-17 15:46:35',0,'931bdba8-cebc-4843-a265-db59cf9842e0','2023-02-17 15:46:34'),(7921,41,10045,'{\"text\": \"@[10050]​为什么 4d 和 刚刚的 3d 没有在一条线上呀\", \"type\": \"text\"}','2023-02-17 15:47:16',2062000020,'TG4g166XEe2nHOpEfxIhvw','2023-02-17 15:47:16'),(7922,41,10050,'{\"text\": \" @[10045]因为3d和4d是不同的坐标点，它们没有在一条水平，垂直或者对角线上。\", \"type\": \"text\", \"reference\": 7921}','2023-02-17 15:47:32',0,'2f340643-378f-44ad-be0c-2a0f1e8335fc','2023-02-17 15:47:31'),(7923,41,10045,'{\"text\": \"@[10050]​为什么同样都是 d ，就没有在水平或者垂直的线上呢？\", \"type\": \"text\"}','2023-02-17 15:49:56',2062000021,'q1vT6q6XEe2nHOpEfxIhvw','2023-02-17 15:49:55'),(7924,41,10050,'{\"text\": \"\", \"type\": \"text\", \"reference\": 7923}','2023-02-17 15:50:27',0,'491404ad-51dd-44da-ae0e-c808133d1a7b','2023-02-17 15:50:27'),(7925,41,10045,'{\"text\": \"@[10050]​？\", \"type\": \"text\"}','2023-02-17 15:56:21',2062000022,'kLqLV66YEe2nHOpEfxIhvw','2023-02-17 15:56:20'),(7926,41,10050,'{\"text\": \" @[10045]因为它们的位置不同，3d表示的是第三行第四列，而4d表示的是第四行第四列，它们不在一条垂直线或者水平线上，也不在一条对角线上。\", \"type\": \"text\", \"reference\": 7925}','2023-02-17 15:56:50',0,'9cc17567-f075-49b2-9ded-1fea7b1097fa','2023-02-17 15:56:50'),(7927,125,10037,'{\"text\": \"??\", \"type\": \"text\", \"reference\": 7847}','2023-02-17 15:57:09',3555000001,'rc-9S66YEe2nHOpEfxIhvw','2023-02-17 15:57:09'),(7928,41,10045,'{\"text\": \"第三行的第四列和第四行的第四列不就是在统一列吗？@[10050]\", \"type\": \"text\"}','2023-02-17 15:57:38',2062000023,'vuEgbq6YEe2nHOpEfxIhvw','2023-02-17 15:57:37'),(7929,41,10050,'{\"text\": \" @[10045]不止这一列，但是它们不在一条垂直或水平线上，也不在一条对角线上。\", \"type\": \"text\", \"reference\": 7928}','2023-02-17 15:57:46',0,'7b6e7a34-29a8-4282-a7df-5e518aa3edaa','2023-02-17 15:57:46'),(7930,41,10045,'{\"text\": \"@[10050]​第三行第四列的棋子为什么放在了第三行的第三个格子中\", \"type\": \"text\"}','2023-02-17 15:59:10',2062000024,'9eLpJ66YEe