8 15:29:43'),(8775,42,10050,'{\"text\": \" 哦，不吃饭可不好哦，快点准备一顿营养的饭菜吧！\", \"type\": \"text\", \"reference\": 8774}','2023-02-28 15:29:50',0,'32528970-752b-42d8-8124-6f759c5681a0','2023-02-28 15:29:49'),(8776,42,10045,'{\"text\": \"@[10050]​什么饭菜比较营养\", \"type\": \"text\"}','2023-02-28 15:30:56',3358000020,'1tpFsbc5Ee2nHOpEfxIhvw','2023-02-28 15:30:56'),(8777,42,10050,'{\"text\": \" 自然是以蔬菜为主的营养餐啦！比如西兰花蒸鸡、豆腐煲、青椒肉丝、西红柿鸡蛋等，搭配上绿色蔬菜，吃出健康！\", \"type\": \"text\", \"reference\": 8776}','2023-02-28 15:31:21',0,'0cd21fbb-d895-442c-a6e6-fb576bc2b933','2023-02-28 15:31:21'),(8778,42,10045,'{\"text\": \"@[10050]​马蝇幼虫能吃吗？\", \"type\": \"text\"}','2023-02-28 15:39:17',3358000021,'AaSO-bc7Ee2nHOpEfxIhvw','2023-02-28 15:39:17'),(8779,42,10050,'{\"text\": \" 吃肯定可以，而且马蝇幼虫还有营养价值哦！可以补充人体所需的蛋白质，真的是一种珍贵的食材呢！\", \"type\": \"text\", \"reference\": 8778}','2023-02-28 15:39:25',0,'6e344400-9c1a-4535-acbf-2d9f319bc7f1','2023-02-28 15:39:24'),(8780,42,10045,'{\"text\": \"@[10050]​郁金香不长花苞是怎么回事\", \"type\": \"text\"}','2023-02-28 15:42:33',3358000022,'dkonsrc7Ee2nHOpEfxIhvw','2023-02-28 15:42:33'),(8781,42,10050,'{\"text\": \" 郁金香不长花苞可能是由于缺少养分、营养物质、水分等导致的，还可能是温湿度不适宜、侵袭性病虫害等原因造成的。\", \"type\": \"text\", \"reference\": 8780}','2023-02-28 15:42:41',0,'5be66c72-cd01-4ecc-ba58-595cd65a5f96','2023-02-28 15:42:41'),(8782,42,10045,'{\"text\": \"@[10050]​郁金香适宜的温度和湿度分别是多少\", \"type\": \"text\"}','2023-02-28 15:42:58',3358000023,'hTMWubc7Ee2nHOpEfxIhvw','2023-02-28 15:42:58'),(8783,42,10050,'{\"text\": \" 郁金香适宜的温度是13～32℃，湿度在45%-70%之间比较适宜，在温度和湿度保持在规定的范围内，就可以培养出美丽的郁金香。\", \"type\": \"text\", \"reference\": 8782}','2023-02-28 15:43:05',0,'985e8136-5c3e-4d46-8960-f00854550ab3','2023-02-28 15:43:05'),(8784,42,10045,'{\"text\": \"@[10050]​郁金香喜光吗？\", \"type\": \"text\"}','2023-02-28 15:43:19',3358000024,'kclTILc7Ee2nHOpEfxIhvw','2023-02-28 15:43:19'),(8785,42,10050,'{\"text\": \" 郁金香很喜欢光，需要充足的阳光，不过一定要避免阳光太强，以免叶片被灼伤。建议在温和宜人的阳光下悠闲赏花，可获得极大的快乐！\", \"type\": \"text\", \"reference\": 8784}','2023-02-28 15:43:27',0,'bc00d246-e2f0-4220-a2f9-ed5fde9f2dbb','2023-02-28 15:43:26'),(8786,42,10045,'{\"text\": \"@[10050]​建议土培还是水培\", \"type\": \"text\"}','2023-02-28 15:43:47',3358000025,'ofi4z7c7Ee2nHOpEfxIhvw','2023-02-28 15:43:46'),(8787,42,10050,'{\"text\": \" 这要看具体的情况，如果你想要快速的成长和良好的花色，可以选择水培，但是需要注意控制水分，以免产生水肿。如果你想要经济实惠，可以选择土培，这样可以避免浪费资源。\", \"type\": \"text\", \"reference\": 8786}','2023-02-28 15:43:55',0,'584f8df7-cff2-422a-887d-931dcc16a7eb','2023-02-28 15:43:55'),(8788,42,10045,'{\"text\": \"@[10050]​水培只加水就可以吗？\", \"type\": \"text\"}','2023-02-28 15:44:53',3358000026,'ygIsCrc7Ee2nHOpEfxIhvw','2023-02-28 15:44:53'),(8789,42,10050,'{\"text\": \" 并不只是加水就可以，水培还需要注意土壤质地、PH值调整以及肥料的添加，才能确保水培维持最佳状态，而且还要定期更换水源，保证水的新鲜度和质量。\", \"type\": \"text\", \"reference\": 8788}','2023-02-28 15:45:02',0,'7a84aa66-86fb-4d89-83c4-775b02f81866','2023-02-28 15:45:02'),(8790,128,10034,'{\"text\": \"@[10057]我需要一副画\", \"type\": \"text\"}','2023-02-28 15:50:48',4846000001,'nT7y9rc8Ee2nHOpEfxIhvw','2023-02-28 15:50:48'),(8791,128,10057,'{\"text\": \"请问您需要什么样的画？\", \"type\": \"text\", \"reference\": 8790}','2023-02-28 15:51:10',0,'b634b77f-4858-4524-ad49-0b503ab05a38','2023-02-28 15:51:10'),(8792,128,10034,'{\"text\": \"富山春居图\", \"type\": \"text\"}','2023-02-28 15:52:24',4846000002,'1pAlS7c8Ee2nHOpEfxIhvw','2023-02-28 15:52:24'),(8793,128,10034,'{\"text\": \"有山有水，一副美丽的风景图@[10057]\", \"type\": \"text\"}','2023-02-28 15:52:59',4846000003,'6tf6Xbc8Ee2nHOpEfxIhvw','2023-02-28 15:52:58'),(8794,128,10057,'{\"text\": \"您打算在哪里购买这幅画？您需要多大尺寸？它是用什么材料制作的？您有多少预算？您需要多久可以收到？\", \"type\": \"text\", \"reference\": 8793}','2023-02-28 15:53:08',0,'0e8b144b-d389-41ff-937b-0fc323a955cd','2023-02-28 15:53:08'),(8795,128,10034,'{\"text\": \"我希望你帮我画这幅图@[10057]\", \"type\": \"text\"}','2023-02-28 15:53:38',4846000004,'Anuc_bc9Ee2nHOpEfxIhvw','2023-02-28 15:53:38'),(8796,128,10057,'{\"text\": \"您想要我用什么样的材料为您画这幅图？您需要多大尺寸？您有多少预算？您希望我用多少时间制作完成？\", \"type\": \"text\", \"reference\": 8795}','2023-02-28 15:53:45',0,'f0cfe190-64e3-4f5d-9a03-21eac5457add'