4',7043000001,'lpHJvL1kEe2nHOpEfxIhvw','2023-03-08 11:52:03'),(9070,42,10050,'{\"text\": \"\\n\\ntype Cook struct {\\n    ID                   int64     `gorm:\\\"primary_key;auto_increment;comment:\'id\'\\\" json:\\\"id\\\"`\\n    Name                 string    `gorm:\\\"not null;default:\'\';comment:\'名称\'\\\" json:\\\"name\\\"`\\n    MoneyReceiveQrCode   string    `gorm:\\\"not null;default:\'\';comment:\'收款码图片地址\'\\\" json:\\\"money_receive_QR_code\\\"`\\n    Neighborhood         int64     `gorm:\\\"not null;default:\'\';comment:\'小区ID\'\\\" json:\\\"neighborhood\\\"`\\n    DetailAddress        string    `gorm:\\\"not null;default:\'\';comment:\'详细地址 (x栋x单元xxx)\'\\\" json:\\\"detail_address\\\"`\\n    UserID               int64     `gorm:\\\"not null;comment:\'用户ID\'\\\" json:\\\"user_id\\\"`\\n    CreatedAt            time.Time `gorm:\\\"not null;default:now();comment:\'创建时间\'\\\" json:\\\"created_at\\\"`\\n    IsReady              int8      `gorm:\\\"not null;default:0;comment:\'是否已经就绪\'\\\" json:\\\"is_ready\\\"`\\n}\\n\\n注：该结构体使用了 GORM tag，可用于数据ORM映射使用。\", \"type\": \"text\", \"reference\": 9069}','2023-03-08 11:52:32',0,'21ed59e8-111b-45ab-bf96-537d46e016d2','2023-03-08 11:52:32'),(9071,42,10045,'{\"text\": \"@[10050]​无需 gorm tag, 但要有 json tag, 采用小驼峰的方式\", \"type\": \"text\"}','2023-03-08 11:54:07',7043000002,'4Ekjub1kEe2nHOpEfxIhvw','2023-03-08 11:54:07'),(9072,42,10050,'{\"text\": \"\\n\\ntype Cook struct {\\n    ID                int64     `json:\\\"id\\\"`\\n    Name              string    `json:\\\"name\\\"`\\n    MoneyReceiveQRCode string    `json:\\\"moneyReceiveQRCode\\\"`\\n    Neighborhood      int64     `json:\\\"neighborhood\\\"`\\n    DetailAddress     string    `json:\\\"detailAddress\\\"`\\n    UserID            int64     `json:\\\"userId\\\"`\\n    CreatedAt         time.Time `json:\\\"createdAt\\\"`\\n    IsReady           int8      `json:\\\"isReady\\\"`\\n}\", \"type\": \"text\", \"reference\": 9071}','2023-03-08 11:54:25',0,'083c84d0-d2bc-4b6b-b211-ccccc3041d1b','2023-03-08 11:54:25'),(9073,42,10045,'{\"text\": \"create table food\\n(\\n    id          bigint primary key auto_increment comment \'id\',\\n    name        varchar(128) not null default \'\' comment \'名称\',\\n    price       decimal      not null comment \'价格\',\\n    begin_time  time         not null comment \'起始时间\',\\n    end_time    time         not null comment \'起始时间\',\\n    weight      varchar(10)  not null default \'normal\' comment \'份量 (small, normal, big)\',\\n    stock       int          not null default 0 comment \'库存\',\\n    cook_id     bigint       not null comment \'关联厨师ID\',\\n    pick_method json         not null default \'[\\n      1,\\n      2\\n    ]\' comment \'取餐方式 1.自取， 2.配送\',\\n    created_at  datetime     not null default now() comment \'数据创建时间\'\\n) comment \'菜品\';\\n\\n把这个表转化为 golang 结构体\\n\", \"type\": \"text\"}','2023-03-08 16:37:44',6463000001,'fpw0er2MEe2nHOpEfxIhvw','2023-03-08 16:37:43'),(9074,42,10045,'{\"text\": \"@[10050]\", \"type\": \"text\"}','2023-03-08 16:38:31',6463000002,'m0J1-L2MEe2nHOpEfxIhvw','2023-03-08 16:38:31'),(9075,42,10050,'{\"text\": \"```\\ntype Food struct {\\n    ID         int64     `json:\\\"id\\\"`\\n    Name       string    `json:\\\"name\\\"`\\n    Price      float64   `json:\\\"price\\\"`\\n    BeginTime  string    `json:\\\"beginTime\\\"` // 起始时间应该使用字符串类型\\n    EndTime    string    `json:\\\"endTime\\\"`\\n    Weight     string    `json:\\\"weight\\\"`\\n    Stock      int       `json:\\\"stock\\\"`\\n    CookID     int64     `json:\\\"cookId\\\"`\\n    PickMethod []int     `json:\\\"pickMethod\\\"`\\n    CreatedAt  time.Time `json:\\\"createdAt\\\"`\\n}\\n```\\n注意：`BeginTime` 和 `EndTime` 应该使用字符串类型，因为使用 `time.Time` 会导致无法正确解析 \\\"00:00:00\\\" 的时间。`PickMethod` 定义为数组类型，因为在 `JSON` 中，它是一个包含多个元素的数组，而不是一个简单的值。\", \"type\": \"text\", \"reference\": 9074}','2023-03-08 16:38:45',0,'c77d9170-63a6-482c-825b-87ddfc023e9b','2023-03-08 16:38:45'),(9076,42,10050,'{\"text\": \"早安，打工人们，我