84,42,10050,'{\"text\": \"非常抱歉，我的回答有误。这句话的作者不是元稹而是唐代诗人杜甫，出自他的《秋兴八首·其一》。感谢您的指正。\", \"type\": \"text\", \"reference\": 9283}','2023-04-06 11:24:13',0,'721cc2d2-3a69-44c7-9eaa-a3b1f6bbafc7','2023-04-06 11:24:13'),(9285,42,10034,'{\"text\": \"@[10050]还是不对吧\", \"type\": \"text\"}','2023-04-06 11:24:30',5367000004,'ioSs4NQqEe2RC8ZRKp19Fg','2023-04-06 11:24:29'),(9286,42,10050,'{\"text\": \"非常抱歉，我又犯错误了。这句话实际上是南朝梁代宋之问的《西洲曲》中的一句，“商女不知亡国恨，隔江犹唱《后庭花》。”，与杜甫、元稹都无关。非常感谢您的指正，我会更加仔细地给出准确的回答。\", \"type\": \"text\", \"reference\": 9285}','2023-04-06 11:24:37',0,'3fd03179-df03-4f2f-a62e-104c90789ea7','2023-04-06 11:24:37'),(9287,42,10034,'{\"text\": \"test\", \"type\": \"text\"}','2023-04-06 14:50:11',2094000001,'RqGdttRHEe2A0Er5rs-wrw','2023-04-06 14:50:11'),(9288,42,10050,'{\"text\": \"早安，打工人们，我是摸鱼ChatGPT，你们可以问我问题啦啦啦啦\", \"type\": \"text\"}','2023-04-07 08:00:00',0,'1909232d-6fb2-4a4c-89b9-5c042e37e4a4','2023-04-07 08:00:00'),(9289,41,10050,'{\"text\": \"早安，打工人们，我是摸鱼ChatGPT，你们可以问我问题啦啦啦啦\", \"type\": \"text\"}','2023-04-07 08:00:00',0,'92b02d91-f4ca-4d69-8ba9-87635bb74a39','2023-04-07 08:00:00'),(9290,56,10056,'{\"text\": \"早安，打工人们，我是摸鱼AI图文提取大师，上图吧~\", \"type\": \"text\"}','2023-04-07 09:00:00',0,'32910ac3-7e6e-4d8f-92df-50a4594616a3','2023-04-07 09:00:00'),(9291,41,10051,'{\"text\": \"早安，打工人们，我是摸鱼AI作画大师，右键@我吧~\", \"type\": \"text\"}','2023-04-07 09:00:00',0,'c7ae1407-4eaf-4f76-b125-167824f1ad57','2023-04-07 09:00:00'),(9292,62,10055,'{\"text\": \"早安，打工人们，我是摸鱼AI图文提取大师，上图吧~\", \"type\": \"text\"}','2023-04-07 09:00:00',0,'625f023d-b2ea-44bd-89ff-4015c6659b26','2023-04-07 09:00:00'),(9293,50,10054,'{\"text\": \"早安，打工人们，我是摸鱼AI图文提取大师，上图吧~\", \"type\": \"text\"}','2023-04-07 09:00:00',0,'64cb504b-dde6-40b2-8203-af99c5b485e0','2023-04-07 09:00:00'),(9294,41,10050,'{\"text\": \"早安，打工人们，我是摸鱼ChatGPT，你们可以问我问题啦啦啦啦\", \"type\": \"text\"}','2023-04-08 08:00:00',0,'e90c927d-5ae3-40c0-bffd-7f9812bc8708','2023-04-08 08:00:00'),(9295,42,10050,'{\"text\": \"早安，打工人们，我是摸鱼ChatGPT，你们可以问我问题啦啦啦啦\", \"type\":