  `uuid` varchar(64) NOT NULL COMMENT '唯一标识',
  `name` varchar(255) NOT NULL COMMENT '名称',
  `category` int(11) NOT NULL DEFAULT '0' COMMENT '分类ID',
  `description` varchar(512) NOT NULL DEFAULT '' COMMENT '描述',
  `form` json NOT NULL COMMENT '表单数组',
  `flow` json NOT NULL COMMENT '流程数组',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态 (0.未发布, 1.已发布)',
  `created_by` bigint(20) NOT NULL COMMENT '创建人ID',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `price` int(11) NOT NULL DEFAULT '0',
  `duplicate_from` varchar(64) DEFAULT NULL COMMENT '模板复制来源',
  PRIMARY KEY (`id`),
  UNIQUE KEY `mini_app_pk` (`uuid`),
  KEY `mini_app__index_category` (`category`),
  KEY `mini_app__index_created_by` (`created_by`),
  KEY `mini_app_uuid_index` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=141 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
