47'),(1403,'95e047ec-7daf-4af8-99b5-f25913d710c0','1842b014-95bb-46b8-8bf9-f1165f1f95e9','text','[\"高铁 地铁 \"]',1,'高铁和地铁赛跑，结果高铁输了，因为它被堵在了地铁口。',10037,'2023-05-10 15:10:47'),(1404,'95e047ec-7daf-4af8-99b5-f25913d710c0','bd812f9a-f32b-4711-92e4-4abce3adb908','text','[\"火车\"]',1,'火车司机问乘客：“你是不是刚才在火车头上摆POSE拍照了？”乘客说：“是啊，我想给我的INS添点新内容。”火车司机：“那我就不得不告诉你，下次请别站在我的车前拍照了，我差点以为你是火车头的新驾驶员呢！”',10037,'2023-05-10 15:11:11'),(1405,'95e047ec-7daf-4af8-99b5-f25913d710c0','d38aa169-c7a9-46b1-a41c-8029139efcd8','text','[\"跑步 \"]',1,'我跑步跑得比闪电还快，结果没看路，一头撞进了公园里的水池里。',10037,'2023-05-10 15:25:17');
