DROP TABLE IF EXISTS `notify_message`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `notify_message` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` bigint(20) unsigned NOT NULL COMMENT '用户ID',
  `type` varchar(32) NOT NULL COMMENT '通知类型',
  `title` varchar(127) NOT NULL COMMENT '通知标题',
  `content` varchar(1024) NOT NULL COMMENT '通知正文',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `is_read` tinyint(4) DEFAULT '0' COMMENT '是否已读',
  `operation_id` varchar(64) NOT NULL COMMENT '操作ID，全局唯一',
  PRIMARY KEY (`id`),
  UNIQUE KEY `notify_message_operation_id_uindex` (`operation_id`)
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
