INSERT INTO `resign_template` VALUES (1,'世界那么大，我想去看看','尊敬的[经理姓名]，\n本人正式递交辞呈，通知您我已辞去[公司名称]的[职务]。我在公司的最后一天是[日期]。\n在[公司名称]任职期间，我逐渐意识到，这个职位的工作范围和我的预期存在较大距离。因此，我想探索其他工作机会。\n感谢您的理解。我也非常感谢您在我任职期间给予的支持和指导。\n对于在[通知期]的交接，如您需要我的任何帮助和支持，请不吝告知。\n诚挚地\n[你的名字]'),(2,'正经辞职模板 除非你看到最后','尊敬的XX领导： \n本人正式向您递交此份辞呈，以通知我辞去[公司名称]的[职务]的打算。按照我的通知期，我的最后一天将是[最后一天的日期]。\n我衷心感谢您给予这个机会，让我在过去的[工作时间]里在这个职位上效力。在这里我得到了很多经验，与同事们的合作亦很愉悦。在这里学到的很多东西对我整个职业生涯都会有所裨益，回顾以往，在这里渡过的时光是我一生宝贵的记忆。\n在接下来的（几周后的通知期内），我将尽我所能做好交接，将我的职责移交给同事们或继任者。在交接过程中，如需进一步帮助，请不吝告知。\n对不起，我家拆迁了。赔得太多了。告辞！'),(3,'来上班？上不赚钱的班？    先去炒老板吧！','尊敬的[经理姓名]，\n本人正式递交辞呈，通知您我将辞去[公司名称]的[职务]。按照我的通知期，我的最后一天将是[最后一天的日期]。\n我获得了另一个职位，新工作不仅能使我每天的通勤时间减半，也能让我在工作之余有更多的时间陪伴家人。\n在过去的[服务的岁月和月份]中，我在[公司]度过了非常愉快的时光，在此我对您表示衷心的感谢。\n在[截止日期]前的未来几周，我将尽我所能，确保交接工作平稳完成。\n诚挚地\n[你的名字]'),(4,'工作是双向选择，你可以随时离开，只要想清楚了未来的路','尊敬的公司领导：\n首先感谢公司近段时间对我的信任和关照，给予了我一个发展的平台，使我有了长足的进步。如今由于个人原因，无法为公司继续服务，现在我正式向公司提出辞职申请，将于20xx年xx月xx日离职，请公司做好相应的安排，在此期间我一定站好最后一班岗，做好交接工作。对此为公司带来的不便，我深感歉意。\n望公司批准，谢谢!\n祝公司业绩蒸蒸日上。\n此致\n敬礼!\n辞职人：xxx\n20xx年xx月xx日'),(5,'不如好聚好散吧，挥挥手，不带走一片云彩','xx：\n自xx年入职以来，我一直很喜欢这份工作，但因某些个人原因，我要重新确定自己未来的方向，最终选择了开始新的工作。\n希望公司能早日找到合适人手接替我的工作并希望能于今年5月底前正式辞职。如能给予我支配更多的时间来找工作我将感激不尽，希望公司理解!在我提交这份辞呈时，在未离开岗位之前，我一定会尽自己的职责，做好应该做的事。\n最后，衷心的说：“对不起”与“谢谢”!\n祝愿公司开创更美好的未来!\n望领导批准我的申请!并协助办理相关离职手续。\n此致\n敬礼!\n辞职人：xxx\n20xx年xx月xx日');
/*!40000 ALTER TABLE `resign_template` ENABLE KEYS */;
UNLOCK TABLES;

